INSERT INTO `categories` VALUES (1,'Fruits','In botany, a fruit is the seed-bearing structure in flowering plants that is formed from the ovary after flowering.\r\nFruits are the means by which flowering plants (also known as angiosperms) disseminate their seeds. Edible fruits in particular have long propagated using the movements of humans and animals in a symbiotic relationship that is the means for seed dispersal for the one group and nutrition for the other; in fact, humans and many animals have become dependent on fruits as a source of food.','https://source.unsplash.com/random/500x500?fruits'),(2,'Herbs','a substance generally derived from flavorful plants that is added to food for the purpose of flavoring food. Seasonings have a wet nature, so they cannot last or be stored for long; it is different with spices which tend to be dry.','https://images.unsplash.com/photo-1467453678174-768ec283a940?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8ZnJ1aXRzfHx8fHx8MTY1MzcyNjM3Mg&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(3,'Meats','Meat is animal flesh that is eaten as food.[1] Humans have hunted, farmed, and scavenged animals for meat since prehistoric times. The establishment of settlements in the Neolithic Revolution allowed the domestication of animals such as chickens, sheep, rabbits, pigs and cattle. This eventually led to their use in meat production on an industrial scale in slaughterhouses.','https://images.unsplash.com/photo-1547637205-fde0c9011f9d?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8bWVhdHN8fHx8fHwxNjUzNzI2NDA5&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(4,'Meals','A meal is an eating occasion that takes place at a certain time and includes prepared food.[1][2] The names used for specific meals in English vary, depending on the speaker\'s culture, the time of day, or the size of the meal. Meals occur primarily at homes, restaurants, and cafeterias, but may occur anywhere. Regular meals occur on a daily basis, typically several times a day. Special meals are usually held in conjunction with such occasions as birthdays, weddings, anniversaries, and holidays. A meal is different from a snack in that meals are generally larger, more varied, and more filling than snacks.','https://images.unsplash.com/photo-1622732777601-e744c3401d44?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8bWVhbHN8fHx8fHwxNjUzNzI2NDI5&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(5,'Beverages','A drink (or beverage) is a liquid intended for human consumption. In addition to their basic function of satisfying thirst, drinks play important roles in human culture. Common types of drinks include plain drinking water, milk, juice, smoothies and soft drinks. Traditionally warm beverages include coffee, tea, and hot chocolate. Caffeinated drinks that contain the stimulant caffeine have a long history','https://images.unsplash.com/photo-1628134187787-51c21f177a6a?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8YmV2ZXJhZ2VzfHx8fHx8MTY1MzcyNjM0Mg&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(6,'Vegetables','Vegetables are parts of plants that are consumed by humans or other animals as food. The original meaning is still commonly used and is applied to plants collectively to refer to all edible plant matter, including the flowers, fruits, stems, leaves, roots, and seeds. An alternative definition of the term is applied somewhat arbitrarily, often by culinary and cultural tradition. It may exclude foods derived from some plants that are fruits, flowers, nuts, and cereal grains, but include savoury fruits such as tomatoes and courgettes, flowers such as broccoli, and seeds such as pulses.','https://images.unsplash.com/photo-1541683746238-470486ba4a00?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8dmVnZXRhYmxlc3x8fHx8fDE2NTM3MjY0NDk&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(7,'Seafoods','Seafood is any form of sea life regarded as food by humans, prominently including fish and shellfish. Shellfish include various species of molluscs (e.g. bivalve molluscs such as clams, oysters and mussels, and cephalopods such as octopus and squid), crustaceans (e.g. shrimp, crabs, and lobster), and echinoderms (e.g. sea cucumbers and sea urchins). Historically, marine mammals such as cetaceans (whales and dolphins) as well as seals have been eaten as food, though that happens to a lesser extent in modern times. Edible sea plants such as some seaweeds and microalgae are widely eaten as sea vegetables around the world, especially in Asia.','https://images.unsplash.com/photo-1615141982883-c7ad0e69fd62?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8c2VhZm9vZHN8fHx8fHwxNjUzNzI2NTMz&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500'),(8,'Groceries','A grocery store (AE), grocery shop (BE) or simply grocery[1] is a store that primarily retails a general range of food products,[2] which may be fresh or packaged. In everyday U.S. usage, however, \"grocery store\" is a synonym for supermarket,[3] and is not used to refer to other types of stores that sell groceries. In the UK, shops that sell food are distinguished as grocers[3] or grocery shops (though in everyday use, people usually use either the term \"supermarket\" or a \"corner shop\"[4] or \"convenience shop\").','https://images.unsplash.com/photo-1526215441679-65290591ff57?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=500&ixid=MnwxfDB8MXxyYW5kb218MHx8Z3JvY2VyaWVzfHx8fHx8MTY1MzcyNjU1NQ&ixlib=rb-1.2.1&q=80&utm_campaign=api-credit&utm_medium=referral&utm_source=unsplash_source&w=500');
