INSERT INTO `products` VALUES (1,1,'Grapes',1000,'grams','https://images.unsplash.com/photo-1423483641154-5411ec9c0ddf?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmFwZXxlbnwwfHx8fDE2NTM0NTIzMDc&ixlib=rb-1.2.1&q=80&raw_url=true','A grape is a fruit. botanically a  berry. of the deciduous woody vines of the flowering plant genus Vitis.\\nGrapes can be eaten fresh as table grapes. used for making wine. jam. grape juice. jelly. grape seed extract. vinegar. and grape seed oil. or dried as raisins. currants and sultanas. Grapes are a non-climacteric type of fruit. generally occurring in clusters.'),(2,1,'Apples',1000,'grams','https://images.unsplash.com/photo-1619546813926-a78fa6372cd2?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxhcHBsZSUyMGZydWl0fGVufDB8fHx8MTY1MzM4NzIzOA&ixlib=rb-1.2.1&q=80&raw_url=true','An apple is an edible fruit produced by an apple tree (Malus domestica). Apple trees are cultivated worldwide and are the most widely grown species in the genus Malus. The tree originated in Central Asia. where its wild ancestor. Malus sieversii. is still found today. Apples have been grown for thousands of years in Asia and Europe and were brought to North America by European colonists. Apples have religious and mythological significance in many cultures. including Norse. Greek. and European Christian tradition.\\nApples grown from seed tend to be very different from those of their parents. and the resultant fruit frequently lacks desired characteristics. Generally. apple cultivars are propagated by clonal grafting onto rootstocks. Apple trees grown without rootstocks tend to be larger and much slower to fruit after planting. Rootstocks are used to control the speed of growth and the size of the resulting tree. allowing for easier harvesting.\\nThere are more than 7.500 known cultivars of apples. Different cultivars are bred for various tastes and uses. including cooking. eating raw. and cider production. Trees and fruit are prone to a number of fungal. bacterial. and pest problems. which can be controlled by a number of organic and non-organic means. In 2010. the fruit\'s genome was sequenced as part of research on disease control and selective breeding in apple production.\\nWorldwide production of apples in 2018 was 86 million tonnes. with China accounting for nearly half of the total.'),(3,1,'Oranges',1000,'grams','https://images.unsplash.com/photo-1509391618207-32f1fa13c1d2?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxvcmFuZ2UlMjBmcnVpdHxlbnwwfHx8fDE2NTMzNzg4Nzc&ixlib=rb-1.2.1&q=80&raw_url=true','An orange is a fruit of various citrus species in the family Rutaceae (see list of plants known as orange); it primarchily refers to Citrus \\u00d7 sinensis. which is also called sweet orange. to distinguish it from the related Citrus \\u00d7 aurantium. referred to as bitter orange. The sweet orange reproduces asexually (apomixis through nucellar embryony); varieties of sweet orange arise through mutations.The orange is a hybrid between pomelo (Citrus maxima) and mandarin (Citrus reticulata). The chloroplast genome. and therefore the maternal line. is that of pomelo. The sweet orange has had its full genome sequenced.The orange originated in a region encompassing Southern China. Northeast India. and Myanmarch. and the earliest mention of the sweet orange was in Chinese literature in 314 BC. As of 1987. orange trees were found to be the most cultivated fruit tree in the world. Orange trees are widely grown in tropical and subtropical climates for their sweet fruit. The fruit of the orange tree can be eaten fresh. or processed for its juice or fragrant peel. As of 2012. sweet oranges accounted for approximately 70% of citrus production.In 2019. 79 million tonnes of oranges were grown worldwide. with Brazil producing 22% of the total. followed by China and India.'),(4,1,'Papayas',1000,'grams','https://images.unsplash.com/photo-1526318472351-c75fcf070305?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxwYXBheWF8ZW58MHx8fHwxNjUzMzc4OTE0&ixlib=rb-1.2.1&q=80&raw_url=true','The papaya (. US: ) (from Carib via Spanish). papaw. () or pawpaw () is the plant Carica papaya. one of the 22 accepted species in the genus Carica of the family Caricaceae. It was first domesticated in Mesoamerica. within modern-day southern Mexico and Central America. In 2020. India produced 43% of the world supply of papayas.'),(5,1,'Bananas',1,'bunch','https://images.unsplash.com/photo-1528825871115-3581a5387919?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxiYW5hbmElMjBmcnVpdHxlbnwwfHx8fDE2NTMzODcyMzg&ixlib=rb-1.2.1&q=80&raw_url=true','A banana is an elongated. edible fruit \\u2013 botanically a berry \\u2013 produced by several kinds of large herbaceous flowering plants in the genus Musa. In some countries. bananas used for cooking may be called \\\"plantains\\\". distinguishing them from dessert bananas. The fruit is variable in size. color. and firmness. but is usually elongated and curved. with soft flesh rich in starch covered with a rind. which may be green. yellow. red. purple. or brown when ripe. The fruits grow upward in clusters near the top of the plant. Almost all modern edible seedless (parthenocarp) bananas come from two wild species \\u2013 Musa acuminata and Musa balbisiana. The scientific names of most cultivated bananas are Musa acuminata. Musa balbisiana. and Musa \\u00d7 paradisiaca for the hybrid Musa acuminata \\u00d7 M. balbisiana. depending on their genomic constitution. The old scientific name for this hybrid. Musa sapientum. is no longer used.\\nMusa species are native to tropical Indomalaya and Australia. and are likely to have been first domesticated in Papua New Guinea. They are grown in 135 countries. primarchily for their fruit. and to a lesser extent to make fiber. banana wine. and banana beer and as ornamental plants. The world\'s largest producers of bananas in 2017 were India and China. which together accounted for approximately 38% of total production.Worldwide. there is no sharp distinction between \\\"bananas\\\" and \\\"plantains\\\". Especially in the Americas and Europe. \\\"banana\\\" usually refers to soft. sweet. dessert bananas. particularly those of the Cavendish group. which are the main exports from banana-growing countries. By contrast. Musa cultivars with firmer. starchier fruit are called \\\"plantains\\\". In other regions. such as Southeast Asia. many more kinds of banana are grown and eaten. so the binary distinction is not as useful and is not made in local languages.\\nThe term \\\"banana\\\" is also used as the common name for the plants that produce the fruit. This can extend to other members of the genus Musa. such as the scarlet banana (Musa coccinea). the pink banana (Musa velutina). and the Fe\'i bananas. It can also refer to members of the genus Ensete. such as the snow banana (Ensete glaucum) and the economically important false banana (Ensete ventricosum). Both genera are in the banana family. Musaceae.'),(6,1,'Watermelons',1000,'grams','https://images.unsplash.com/photo-1621435696416-c4a319ee13d4?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx3YXRlcm1lbG9uJTIwZnJ1aXR8ZW58MHx8fHwxNjUzMzg3MjM5&ixlib=rb-1.2.1&q=80&raw_url=true','Watermelon (Citrullus lanatus) is a flowering plant species of the Cucurbitaceae family and the name of its edible fruit. A scrambling and trailing vine-like plant. it is a highly cultivated fruit worldwide. with more than 1.000 varieties.\\nWatermelon is grown in favorable climates from tropical to temperate regions worldwide for its large edible fruit. which is a berry with a hard rind and no internal divisions. and is botanically called a pepo. The sweet. juicy flesh is usually deep red to pink. with many black seeds. although seedless varieties exist. The fruit can be eaten raw or pickled. and the rind is edible after cooking. It may also be consumed as a juice or as an ingredient in mixed beverages.\\nKordofan melons from Sudan are the closest relatives and may be progenitors of modern. cultivated watermelons. Wild watermelon seeds were found in Uan Muhuggiag. a prehistoric site in Libya that dates to approximately 3500 BC. Watermelons were domesticated in Egypt by 2000 BC. although they were not the sweet modern variety. Sweet dessert watermelons spread across the Mediterranean world during Roman times.Considerable breeding effort has developed disease-resistant varieties. Many cultivars are available that produce mature fruit within 100 days of planting. In 2017. China produced about two-thirds of the world total of watermelons.'),(7,1,'Coconuts',1,'piece','https://images.unsplash.com/photo-1560769680-ba2f3767c785?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjb2NvbnV0fGVufDB8fHx8MTY1MzM3OTI1OQ&ixlib=rb-1.2.1&q=80&raw_url=true','The coconut tree (Cocos nucifera) is a member of the palm tree family (Arecaceae) and the only living species of the genus Cocos. The term \\\"coconut\\\" (or the archaic \\\"cocoanut\\\") can refer to the whole coconut palm. the seed. or the fruit. which botanically is a drupe. not a nut. The name comes from the old Portuguese word coco. meaning \\\"head\\\" or \\\"skull\\\". after the three indentations on the coconut shell that resemble facial features. They are ubiquitous in coastal tropical regions and are a cultural icon of the tropics.\\nThe coconut tree provides food. fuel. cosmetics. folk medicine and building materials. among many other uses. The inner flesh of the mature seed. as well as the coconut milk extracted from it. form a regular part of the diets of many people in the tropics and subtropics. Coconuts are distinct from other fruits because their endosperm contains a large quantity of clear liquid. called coconut water or coconut juice. Mature. ripe coconuts can be used as edible seeds. or processed for oil and plant milk from the flesh. charcoal from the hard shell. and coir from the fibrous husk. Dried coconut flesh is called copra. and the oil and milk derived from it are commonly used in cooking \\u2013 frying in particular \\u2013 as well as in soaps and cosmetics. Sweet coconut sap can be made into drinks or fermented into palm wine or coconut vinegar. The hard shells. fibrous husks and long pinnate leaves can be used as material to make a variety of products for furnishing and decoration.\\nThe coconut has cultural and religious significance in certain societies. particularly in the Western Pacific Austronesian cultures where it features in their mythologies. songs. and oral traditions. It also had ceremonial importance in pre-colonial animistic religions. It has also acquired religious significance in South Asian cultures. where it is used in Hindu rituals. It forms the basis of wedding and worship rituals in Hinduism. It also plays a central role in the Coconut Religion of Vietnam. The falling nature of their mature fruit has led to preoccupation with death by coconut.Coconuts were first domesticated by the Austronesian peoples in Island Southeast Asia and were spread during the Neolithic via their seaborne migrations as far east as the Pacific Islands. and as far west as Madagascar and the Comoros. They played a critical role in the long sea voyages of Austronesians by providing a portable source of food and water. as well as providing building materials for Austronesian outrigger boats. Coconuts were also later spread in historic times along the coasts of the Indian and Atlantic Oceans by South Asian. Arab. and European sailors. Coconut populations today can still be divided into two based on these separate introductions - the Pacific coconuts and Indo-Atlantic coconuts. respectively. Coconuts were introduced by Europeans to the Americas only during the colonial era in the Columbian exchange. but there is evidence of a possible pre-Columbian introduction of Pacific coconuts to Panama by Austronesian sailors. The evolutionary origin of the coconut is under dispute. with theories stating that it may have evolved in Asia. South America. or on Pacific islands. Trees grow up to 30 m (100 ft) tall and can yield up to 75 fruits per year. though fewer than 30 is more typical. Plants are intolerant of cold weather and prefer copious precipitation. as well as full sunlight. Many insect pests and diseases affect the species and are a nuisance for commercial production. About 75% of the world\'s supply of coconuts is produced by Indonesia. the Philippines. and India combined.'),(8,2,'Garlics',1000,'grams','https://images.unsplash.com/photo-1501420193726-1f65acd36cda?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxnYXJsaWN8ZW58MHx8fHwxNjUzMzc5MzM0&ixlib=rb-1.2.1&q=80&raw_url=true','Garlic (Allium sativum) is a species of bulbous flowering plant in the genus Allium. Its close relatives include the onion. shallot. leek. chive. Welsh onion and Chinese onion. It is native to Central Asia and northeastern Iran and has long been used as a seasoning worldwide. with a history of several thousand years of human consumption and use. It was known to ancient Egyptians and has been used as both a food flavoring and a traditional medicine. China produces 76% of the world\'s supply of garlic.'),(9,2,'Monosodium Glutamate',1,'ounce','https://images.unsplash.com/photo-1517646458010-ea6bd9f4a75f?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzZWFzb25pbmd8ZW58MHx8fHwxNjUzMzc5NDU0&ixlib=rb-1.2.1&q=80&raw_url=true','Monosodium glutamate (MSG). also known as sodium glutamate.  is the sodium salt of glutamic acid.  MSG is found naturally in some foods including tomatoes and cheese in this glutamic acid form. MSG is used in cooking as a flavor enhancer with an umami taste that intensifies the meaty. savory flavor of food. as naturally occurring glutamate does in foods such as stews and meat soups.MSG was first prepared in 1908 by Japanese biochemist Kikunae Ikeda. who was trying to isolate and duplicate the savory taste of kombu. an edible seaweed used as a base for many Japanese soups. MSG balances. blends. and rounds the perception of other tastes.  MSG is commonly used and found in stock (bouillon) cubes. soups. ramen. gravy. stews. condiments. savory snacks. etc.\\nThe U.S. Food and Drug Administration has given MSG its generally recognized as safe (GRAS) designation. It is a popular myth that MSG can cause headaches and other feelings of discomfort. known as \\\"Chinese restaurant syndrome\\\". but blinded studies show no such effects when MSG is combined with food in normal concentrations. and are inconclusive when MSG is added to broth in large concentrations. The European Union classifies it as a food additive permitted in certain foods and subject to quantitative limits. MSG has the HS code 29224220 and the E number E621.\\n\\n'),(10,2,'Food Powder',1,'package','https://images.unsplash.com/photo-1517646458010-ea6bd9f4a75f?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzZWFzb25pbmd8ZW58MHx8fHwxNjUzMzc5NDU0&ixlib=rb-1.2.1&q=80&raw_url=true','Food powder or powdery food is the most common format of dried solid food material that meets specific quality standards. such as moisture content. particle size. and particular morphology. Common powdery food products include milk powder. tea powder. cocoa powder. coffee powder. soybean flour. wheat flour. and chili powder. Powders are particulate discrete solid particles of size ranging from nanometres to millimetres that generally flow freely when shaken or tilted. The bulk powder properties are the combined effect of particle properties by the conversion of food products in solid state into powdery form for ease of use. processing and keeping quality. Various terms are used to indicate the particulate solids in bulk. such as powder. granules. flour and dust. though all these materials can be treated under powder category. These common terminologies are based on the size or the source of the materials.\\nThe particle size. distribution. shape and surface characteristics and the density of the powders are highly variable and depend on both the characteristics of the raw materials and processing conditions during their formations. These parameters contribute to the functional properties of powders. including flowability. packaging density. ease of handling. dust forming. mixing. compressibility and surface activity.'),(11,2,'Brown Sugar',1000,'grams','https://images.unsplash.com/photo-1613228295977-3b5ac7533b36?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxicm93biUyMHN1Z2FyfGVufDB8fHx8MTY1MzM3OTY2OQ&ixlib=rb-1.2.1&q=80&raw_url=true','Brown sugar is a sucrose sugar product with a distinctive brown color due to the presence of molasses. It is either an unrefined or partially refined soft sugar consisting of sugar crystals with some residual molasses content (natural brown sugar). or it is produced by the addition of molasses to refined white sugar (commercial brown sugar).\\nThe Codex Alimentarius requires brown sugar to contain at least 88% of sucrose plus invert sugar. Commercial brown sugar contains from 3.5% molasses (light brown sugar) to 6.5% molasses (dark brown sugar) based on total volume. Based on total weight. regular commercial brown sugar contains up to 10% molasses. The product is naturally moist from the hygroscopic nature of the molasses and is often labelled as \\\"soft.\\\" The product may undergo processing to give a product that flows better for industrial handling. The addition of dyes or other chemicals may be permitted in some areas or for industrial products.\\nParticle size is variable but generally smaller than granulated white sugar. Products for industrial use (e.g.. the industrial production of cakes) may be based on caster sugar. which has crystals of approximately 0.35 mm.'),(12,2,'Sweet Soy Sauce',1,'bottle','https://images.unsplash.com/photo-1563599175592-c58dc214deff?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzYXVjZXN8ZW58MHx8fHwxNjUzMzgwMDUw&ixlib=rb-1.2.1&q=80&raw_url=true','Sweet soy sauce (Indonesian: kecap manis) is a sweetened aromatic soy sauce. originating in Indonesia. which has a darker color. a viscous syrupy consistency and a molasses-like flavor due to the generous addition of palm sugar or jaggery. Kecap manis is widely used with satay. It is similar to. though finer in flavor than. Chinese Tianmian sauce (tianmianjiang). It is by far the most popular type of soy sauce employed in Indonesian cuisine. and accounts for an estimated 90 percent of the nation\'s total soy sauce production.\\n\\n'),(13,2,'Candlenut',1,'ounce','https://images.unsplash.com/photo-1622948765111-7ba69778cbdb?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYW5kbGVudXR8ZW58MHx8fHwxNjUzMzgwMDYw&ixlib=rb-1.2.1&q=80&raw_url=true','Aleurites moluccanus. the candlenut. is a flowering tree in the spurge family. Euphorbiaceae. also known as candleberry. Indian walnut. kemiri. varnish tree. nuez de la India. buah keras. godou. kukui nut tree. and rata kekuna.'),(14,2,'Black Peppers',1,'ounce','https://images.unsplash.com/photo-1574685379681-1aacfc4f22d8?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxibGFjayUyMHBlcHBlcnxlbnwwfHx8fDE2NTMzODAwNzI&ixlib=rb-1.2.1&q=80&raw_url=true','Black pepper (Piper nigrum) is a flowering vine in the family Piperaceae. cultivated for its fruit. known as a peppercorn. which is usually dried and used as a spice and seasoning. The fruit is a drupe (stonefruit) which is about 5 mm (0.20 in) in diameter (fresh and fully mature). dark red. and contains a stone which encloses a single pepper seed. Peppercorns and the ground pepper derived from them may be described simply as pepper. or more precisely as black pepper (cooked and dried unripe fruit). green pepper (dried unripe fruit). or white pepper (ripe fruit seeds).Black pepper is native to the Malabar Coast of India. and the Malabar pepper is extensively cultivated there and in other tropical regions.\\nGround. dried. and cooked peppercorns have been used since antiquity. both for flavour and as a traditional medicine. Black pepper is the world\'s most traded spice. and is one of the most common spices added to cuisines around the world. Its spiciness is due to the chemical compound piperine. which is a different kind of spicy from the capsaicin characteristic of chili peppers. It is ubiquitous in the Western world as a seasoning. and is often paired with salt and available on dining tables in shakers or mills.'),(15,2,'Shrimp Paste',1,'ounce','https://images.unsplash.com/photo-1653006950343-9c313ba049a9?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzaHJpbXAlMjBwYXN0ZXxlbnwwfHx8fDE2NTMzODAwODg&ixlib=rb-1.2.1&q=80&raw_url=true','Shrimp paste or prawn sauce is a fermented condiment commonly used in Southeast Asian and Southern Chinese cuisines. It is primarchily made from finely crushed shrimp or krill mixed with salt. and then fermented for several weeks. They are either sold in their wet form or are sun-dried and either cut into rectangular blocks or sold in bulk. It is an essential ingredient in many curries. sauces and sambal. Shrimp paste can be found in many meals in Cambodia. Indonesia. Laos. Malaysia. Myanmarch. the Philippines. Singapore. Thailand. and Vietnam. It is often an ingredient in dip for fish or vegetables.'),(16,3,'Chicken',1,'head','https://images.unsplash.com/photo-1556316918-880f9e893822?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjaGlja2VufGVufDB8fHx8MTY1MzM4MDIxOQ&ixlib=rb-1.2.1&q=80&raw_url=true','A chicken sandwich is a sandwich that typically consists of boneless. skinless chicken breast or thigh served between slices of bread. on a bun. or on a roll. Variations on the \\\"chicken sandwich\\\" include the chicken burger. chicken on a bun. chickwich. hot chicken. or chicken salad sandwich.\\nIn American English. a sandwich is any two pieces of bread with filling. including rolls and buns; in British English (and also some other national English varieties such as those of Australia and New Zealand). the word sandwich is defined more narrowly. to require the pieces of bread to be sliced from a loaf. and a roll or bun with filling would not generally be called a sandwich. A bun with a cooked chicken breast as filling would generally be called a chicken sandwich in the US. but in Australia and New Zealand such a dish is not considered a sandwich. and would generally be called a chicken burger instead; most Americans would not consider such as dish to count as a burger. since Americans generally consider a burger to require a patty made from ground/minced meat.'),(17,3,'Chicken Liver (food)',1,'piece','https://images.unsplash.com/photo-1471623817296-aa07ae5c9f47?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjaGlja2VuJTIwbGl2ZXJ8ZW58MHx8fHwxNjUzNDUyMjA0&ixlib=rb-1.2.1&q=80&raw_url=true','The liver of mammals. fowl. and fish is commonly eaten as food by humans (see offal). Pork. lamb. veal. beef. chicken. goose. and cod livers are widely available from butchers and supermarchkets while stingray and burbot livers are common in some European countries. Animal livers are rich in iron. copper. the B vitamins and preformed vitamin A. It is unsure if daily consumption of liver can be harmful. as no conclusive research has been done on the toxicity of preformed vitamin A from food. A single serving of beef liver exceeds the tolerable upper intake level of vitamin A. 100 g cod liver contains 5 mg of vitamin A and 100 \\u00b5g of vitamin D. Liver was one of the reasons for discovering vitamin B12. which was later found to contain large amounts of it.'),(18,4,'Cassava',1000,'grams','https://images.unsplash.com/photo-1471771327165-aa841af98748?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXNzYXZhfGVufDB8fHx8MTY1MzM4MDMzNQ&ixlib=rb-1.2.1&q=80&raw_url=true','Manihot esculenta. commonly called cassava (). manioc. or yuca (among numerous regional names) is a woody shrub  of the spurge family. Euphorbiaceae. native to South America. Although a perennial plant. cassava is extensively cultivated as an annual crop in tropical and subtropical regions for its edible starchy tuberous root. a major source of carbohydrates. Though it is often called yuca in parts of Spanish America and in the United States. it is not related to yucca. a shrub in the family Asparagaceae. Cassava is predominantly consumed in boiled form. but substantial quantities are used to extract cassava starch. called tapioca. which is used for food. animal feed. and industrial purposes. The Brazilian farinha. and the related garri of West Africa. is an edible coarse flour obtained by grating cassava roots. pressing moisture off the obtained grated pulp. and finally drying it (and roasting both in the case of farinha and garri).\\nCassava is the third-largest source of food carbohydrates in the tropics. after rice and maize. Cassava is a major staple food in the developing world. providing a basic diet for over half a billion people. It is one of the most drought-tolerant crops. capable of growing on marchginal soils. Nigeria is the world\'s largest producer of cassava. while Thailand is the largest exporter of cassava starch.\\nCassava is classified as either sweet or bitter. Like other roots and tubers. both bitter and sweet varieties of cassava contain antinutritional factors and toxins. with the bitter varieties containing much larger amounts. It must be properly prepared before consumption. as improper preparation of cassava can leave enough residual cyanide to cause acute cyanide intoxication. goiters. and even ataxia. partial paralysis. or death. The more toxic varieties of cassava are a fall-back resource (a \\\"food security crop\\\") in times of famine or food insecurity in some places. Farmers often prefer the bitter varieties because they deter pests. animals. and thieves.'),(19,4,'Instant Noodles',1,'package','https://images.unsplash.com/photo-1587115507286-f27e42621c25?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxpbnN0YW50JTIwbm9vZGxlfGVufDB8fHx8MTY1MzQ1MjIwNA&ixlib=rb-1.2.1&q=80&raw_url=true','Instant noodles. or instant ramen. are noodles sold in a precooked and dried block with flavoring powder and/or seasoning oil. Ramen. a Japanese adaptation of Chinese noodle soup. is sometimes used as a descriptor for instant noodle flavors by some Japanese manufacturers. It has become synonymous in the United States for all instant noodle products.\\nThe main ingredients in instant noodles are flour. starch. water. salt and/or a salt substitute known as kansui (a type of alkaline mineral water containing sodium carbonate and usually potassium carbonate). and sometimes a small amount of phosphoric acid. Specific types of noodles can be made from a mix of wheat and other flour. such as buckwheat. There are variations to the ingredients used. depending on the country of origin. in terms of the salt and flour content. Common ingredients in the flavoring powder are salt. monosodium glutamate. seasoning. and sugar. The flavoring is usually in a separate packet. although in the case of cup noodles. it is often loose in the cup. Some instant noodle products are seal-packed; these can be reheated or eaten straight from the packet/container. Dried noodle blocks are designed to be cooked or soaked in boiling water before eating but can be consumed dry. The dried noodle block was originally created by flash frying cooked noodles. and this is still the main method used in Asian countries; air-dried noodle blocks are favored in Western countries.\\nInstant noodles were invented by Momofuku Ando of Nissin Foods in Japan. They were launched in 1958 under the brand name Chikin Ramen. In 1971. Nissin introduced Cup Noodles. the first cup noodle product. Instant noodles are marchketed worldwide under many brand names.\\nDue to the versatility of instant noodles. they can be used as an alternative to typical long noodles. They are used to make dishes such as ramen. Korean army stew. and even chow mein.'),(20,4,'Meatball',1,'piece','https://images.unsplash.com/photo-1529042410759-befb1204b468?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtZWF0YmFsbHxlbnwwfHx8fDE2NTM0NTIyMDU&ixlib=rb-1.2.1&q=80&raw_url=true','A meatball is ground meat rolled into a small ball. sometimes along with other ingredients. such as bread crumbs. minced onion. eggs. butter. and seasoning. Meatballs are cooked by frying. baking. steaming. or braising in sauce. There are many types of meatballs using different types of meats and spices. The term is sometimes extended to meatless versions based on vegetables or fish; the latter are also commonly known as fishballs.'),(21,4,'Baby Foods',1,'pack','https://images.unsplash.com/photo-1550461716-dbf266b2a8a7?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxiYWJ5JTIwZm9vZHxlbnwwfHx8fDE2NTMzODAzNjk&ixlib=rb-1.2.1&q=80&raw_url=true','Baby food is any soft. easily consumed food other than breastmilk or infant formula that is made specifically for human babies between four and six months and two years old. The food comes in many varieties and flavors that are purchased ready-made from producers. or it may be table food eaten by the family that has been mashed or otherwise broken down.'),(22,4,'Tofu (food)',1000,'grams','https://images.unsplash.com/photo-1578208705933-3c843e49af66?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx3aGl0ZSUyMHRvZnV8ZW58MHx8fHwxNjUzNDUyMzA4&ixlib=rb-1.2.1&q=80&raw_url=true','also known as bean curd. is a food prepared by coagulating soy milk and then pressing the resulting curds into solid white blocks of varying softness; it can be silken. soft. firm. extra firm or super firm. Beyond these broad textural categories. there are many varieties of tofu. It has a subtle flavor. so it can be used in savory and sweet dishes. It is often seasoned or marchinated to suit the dish and its flavors. and due to its spongy texture it absorbs flavors well.\\nNutritionally. tofu is low in calories. while containing a relatively large amount of protein. It is high in iron. and can have a high calcium or magnesium content depending on the coagulants (e.g. calcium chloride. calcium sulphate. magnesium sulphate) used in manufacturing.\\nTofu first originated in China and has been consumed within China for over 2.000 years dating back to the Han dynasty. It is also a traditional component of the cuisines of East and Southeast Asia. including in Indonesia. Japan. Korea. Singapore. Thailand and Vietnam.'),(23,4,'Tempeh',1000,'grams','https://images.unsplash.com/photo-1570145820386-15a56730192c?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx0ZW1wZWh8ZW58MHx8fHwxNjUzNDUyMjA1&ixlib=rb-1.2.1&q=80&raw_url=true','Tempeh or tempe (; Javanese: \\ua9a0\\ua9ba\\ua9a9\\ua9c0\\ua9a5\\ua9ba. romanized: t\\u00e9mp\\u00e9. pronounced [tempe]) is a traditional Indonesian food made from fermented soybeans. It is made by a natural culturing and controlled fermentation process that binds soybeans into a cake form. A fungus. Rhizopus oligosporus or Rhizopus oryzae. is used in the fermentation process and is also known as tempeh starter. \\n\\nIt is especially popular on the island of Java. where it is a staple source of protein. Like tofu. tempeh is made from soybeans. but it is a whole soybean product with different nutritional characteristics and textural qualities. Tempeh\'s fermentation process and its retention of the whole bean give it a higher content of protein. dietary fiber. and vitamins. It has a firm texture and an earthy flavor. which becomes more pronounced as it ages.'),(24,4,'Gelatin Powder',1,'package','https://images.unsplash.com/photo-1558240704-a45b9fc3d4d6?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxnZWxhdGluJTIwcG93ZGVyfGVufDB8fHx8MTY1MzM4MDUyMQ&ixlib=rb-1.2.1&q=80&raw_url=true','Gelatin or gelatine (from Latin: gelatus meaning \\\"stiff\\\" or \\\"frozen\\\") is a translucent. colorless. flavorless food ingredient. commonly derived from collagen taken from animal body parts. It is brittle when dry and rubbery when moist. It may also be referred to as hydrolyzed collagen. collagen hydrolysate. gelatine hydrolysate. hydrolyzed gelatine. and collagen peptides after it has undergone hydrolysis. It is commonly used as a gelling agent in food. beverages. medications. drug and vitamin capsules. photographic films and papers. and cosmetics.\\nSubstances containing gelatin or functioning in a similar way are called gelatinous substances. Gelatin is an irreversibly hydrolyzed form of collagen. wherein the hydrolysis reduces protein fibrils into smaller peptides; depending on the physical and chemical methods of denaturation. the molecular weight of the peptides falls within a broad range. Gelatin is in gelatin desserts. most gummy candy and marchshmallows.  ice creams. dips. and yogurts. Gelatin for cooking comes as powder. granules. and sheets. Instant types can be added to the food as they are; others must soak in water beforehand.\\n\\n'),(25,4,'Emping',1000,'grams','https://images.unsplash.com/photo-1599490659213-e2b9527bd087?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjaGlwc3xlbnwwfHx8fDE2NTMzODA2NTk&ixlib=rb-1.2.1&q=80&raw_url=true','Emping are a type of Indonesian chips. a bite-size snack kripik cracker. made of melinjo or belinjo (Gnetum gnemon) nuts (which are seeds). Emping crackers have a slightly bitter taste. Emping snacks are available in marchkets plain (original). salty. spicy or sweet. depending on the addition of salt or caramelized sugar.'),(26,4,'Fish Crackers',1000,'grams','https://images.unsplash.com/photo-1599490659213-e2b9527bd087?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjaGlwc3xlbnwwfHx8fDE2NTMzODA2NTk&ixlib=rb-1.2.1&q=80&raw_url=true','Fish crackers are deep fried crackers made from fish and spices that serve as flavouring. originated from Indonesia. The crackers also mixed with tapioca flour and/or sago flour as the main ingredients and the salt. sugar and MSG as seasonings. Fish crackers can be found in Southeast Asia and East Asia. However. they are more varied and commonly found in Indonesia and Malaysia.'),(27,4,'Shrimp Crackers',1000,'grams','https://images.unsplash.com/photo-1599490659213-e2b9527bd087?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjaGlwc3xlbnwwfHx8fDE2NTMzODA2NTk&ixlib=rb-1.2.1&q=80&raw_url=true','Prawn crackers (Indonesian: krupuk udang) are a deep fried snack made from starch and prawn. They are a common snack food in Southeast Asian cuisine. but they are most closely associated with Indonesia and Malaysia. They have also been adapted into East Asian cuisines. where the similar Japanese kappa ebisen (\\u304b\\u3063\\u3071\\u3048\\u3073\\u305b\\u3093) (Japan) and Korean saeukkang (Korea) are popular snacks.'),(28,4,'Fried Chicken',1,'piece','https://images.unsplash.com/photo-1626082896492-766af4eb6501?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxmcmllZCUyMGNoaWNrZW58ZW58MHx8fHwxNjUzNDUxMTgz&ixlib=rb-1.2.1&q=80&raw_url=true','Fried chicken. also known as Southern fried chicken. is a dish consisting of chicken pieces that have been coated with seasoned flour or batter and pan-fried. deep fried. pressure fried. or air fried. The breading adds a crisp coating or crust to the exterior of the chicken while retaining juices in the meat. Broiler chickens are most commonly used.\\nThe first dish known to have been deep fried was fritters. which were popular in the European Middle Ages. However. it was the Scottish who were the first Europeans to deep fry their chicken in fat (though without seasoning). Meanwhile. many West African peoples had traditions of seasoned fried chicken (though battering and cooking the chicken in palm oil). Scottish frying techniques and West African seasoning techniques were combined by enslaved Africans and African-Americans in the American South.'),(29,4,'Biscuit',1,'tin','https://images.unsplash.com/photo-1558961363-fa8fdf82db35?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjb29raWV8ZW58MHx8fHwxNjUzMzg5MDc5&ixlib=rb-1.2.1&q=80&raw_url=true','A biscuit is a flour-based baked and shaped food product. In most countries biscuits are typically hard. flat. and unleavened. They are usually sweet and may be made with sugar. chocolate. icing. jam. ginger. or cinnamon. They can also be savoury. similar to crackers. Biscuit may also refer to hard flour-based baked animal feed. as with dog biscuit.\\nIn most of North America. nearly all hard sweet biscuits are called \\\"cookies\\\". while the term \\\"biscuit\\\" is used for a soft. leavened quick bread similar to a scone - see biscuit (bread).\\nTypes of biscuit include sandwich biscuits. digestive biscuits. ginger biscuits. shortbread biscuits. chocolate chip cookies. chocolate-coated marchshmallow treats. Anzac biscuits. biscotti. and speculaas.'),(30,4,'Doughnut',1,'piece','https://images.unsplash.com/photo-1533910534207-90f31029a78e?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxkb3VnaG51dHxlbnwwfHx8fDE2NTM0NTEyNDA&ixlib=rb-1.2.1&q=80&raw_url=true','A doughnut or donut () is a type of food made from leavened fried dough.:\\u200a275\\u200a It is popular in many countries and is prepared in various forms as a sweet snack that can be homemade or purchased in bakeries. supermarchkets. food stalls. and franchised specialty vendors. Doughnut is the traditional spelling. while donut is the simplified version; the terms are often used interchangeably.\\nDoughnuts are usually deep fried from a flour dough. but other types of batters can also be used. Various toppings and flavorings are used for different types. such as sugar. chocolate or maple glazing. Doughnuts may also include water. leavening. eggs. milk. sugar. oil. shortening. and natural or artificial flavors.:\\u200a232\\u200aThe two most common types are the ring doughnut and the filled doughnut. which is injected with fruit preserves (the jelly doughnut). cream. custard. or other sweet fillings. Small pieces of dough are sometimes cooked as doughnut holes. Once fried. doughnuts may be glazed with a sugar icing. spread with icing or chocolate. or topped with powdered sugar. cinnamon. sprinkles or fruit. Other shapes include balls. flattened spheres. twists. and other forms. Doughnut varieties are also divided into cake (including the old-fashioned) and yeast-risen type doughnuts. Doughnuts are often accompanied by coffee or milk. They are sold at doughnut shops. convenience stores. petrol/gas stations. cafes or fast food restaurants.'),(31,4,'Gado-Gado',1,'portion','https://images.unsplash.com/photo-1540420773420-3366772f4999?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzYWxhZHxlbnwwfHx8fDE2NTMzODkyNTE&ixlib=rb-1.2.1&q=80&raw_url=true','Gado-gado (Indonesian or Betawi) is an Indonesian salad of raw. slightly boiled. blanched or steamed vegetables and hard-boiled eggs. boiled potato.  fried tofu and tempeh. and lontong (rice wrapped in a banana leaf). served with a peanut sauce dressing.In 2018. gado-gado was promoted as one of five national dishes of Indonesia; the others are soto. sate. nasi goreng. and rendang.'),(32,4,'Grilled Fish',1,'head','https://images.unsplash.com/photo-1556814901-18c866c057da?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmlsbGVkJTIwZmlzaHxlbnwwfHx8fDE2NTMzODkyNjg&ixlib=rb-1.2.1&q=80&raw_url=true','This is a list of notable fish dishes. In culinary and fishery contexts. fish includes shellfish. such as molluscs. crustaceans and echinoderms. Fish has been an important source of protein for humans throughout recorded history.'),(33,4,'Cotton Candy',1,'package','https://images.unsplash.com/photo-1516642898673-edd1ced08e87?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjb3R0b24lMjBjYW5keXxlbnwwfHx8fDE2NTM0NTIzMTA&ixlib=rb-1.2.1&q=80&raw_url=true','Cotton candy. also known as  fairy floss and  candy floss. is a spun sugar confection that resembles cotton. It usually contains small amounts of flavoring or food coloring.It is made by heating and liquefying sugar. and spinning it centrifugally through minute holes. causing it to rapidly cool and re-solidify into fine strands. It is often sold at fairs. circuses. carnivals. and festivals. served in a plastic bag. on a stick. or on a paper cone.It is made and sold globally. as candy floss in the UK. Ireland. Egypt. India (also known as grandma\'s hair). New Zealand. Sri Lanka. and South Africa; as \\\"girls hair\\\" in United Arab Emirates. and Saudi Arabia; and as fairy floss in Australia. Similar confections include Korean kkul-tarae and Persian pashmak.'),(34,4,'Cakes',1,'piece','https://images.unsplash.com/photo-1563729784474-d77dbb933a9e?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYWtlfGVufDB8fHx8MTY1MzM4OTMzOA&ixlib=rb-1.2.1&q=80&raw_url=true','Cake is a form of sweet food made from flour. sugar. and other ingredients. that is usually baked. In their oldest forms. cakes were modifications of bread. but cakes now cover a wide range of preparations that can be simple or elaborate. and that share features with other desserts such as pastries. meringues. custards. and pies.\\nThe most commonly used cake ingredients include flour. sugar. eggs. butter or oil or marchgarine. a liquid. and a leavening agent. such as baking soda or baking powder. Common additional ingredients and flavourings include dried. candied. or fresh fruit. nuts. cocoa. and extracts such as vanilla. with numerous substitutions for the primarchy ingredients. Cakes can also be filled with fruit preserves. nuts or dessert sauces (like custard. jelly. cooked fruit. whipped cream or syrups). iced with buttercream or other icings. and decorated with marchzipan. piped borders. or candied fruit.\\nCake is often served as a celebratory dish on ceremonial occasions. such as weddings. anniversaries. and birthdays. There are countless cake recipes; some are bread-like. some are rich and elaborate. and many are centuries old. Cake making is no longer a complicated procedure; while at one time considerable labor went into cake making (particularly the whisking of egg foams). baking equipment and directions have been simplified so that even the most amateur of cooks may bake a cake.'),(35,4,'Fried Snack',1,'piece','https://images.unsplash.com/photo-1511910567178-88eb0fdca008?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzbmFjayUyMGNvb2tpZXxlbnwwfHx8fDE2NTM0NTEzOTI&ixlib=rb-1.2.1&q=80&raw_url=true','Deep-fried butter is a snack food made of butter coated with a batter or breading and then deep-fried. The dish has often been served at fairs in the US; among them. the State Fair of Texas in Dallas. Texas. and the Iowa State Fair in Des Moines. Iowa. Fried butter is a similar dish. for which recipes exist dating to the 17th century.'),(36,4,'Snacks)',1,'package','https://images.unsplash.com/photo-1621939514649-280e2ee25f60?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzbmFja3N8ZW58MHx8fHwxNjUzNDUxNDk2&ixlib=rb-1.2.1&q=80&raw_url=true','A snack is a small portion of food generally eaten between meals. Snacks come in a variety of forms including packaged snack foods and other processed foods. as well as items made from fresh ingredients at home.\\nTraditionally. snacks are prepared from ingredients commonly available at home without a great deal of preparation. Often cold cuts. fruits. leftovers. nuts. sandwiches. and sweets are used as snacks.  With the spread of convenience stores. packaged snack foods became a significant business.\\nSnack foods are typically designed to be portable. quick. and satisfying.  Processed snack foods. as one form of convenience food. are designed to be less perishable. more durable. and more portable than prepared foods.  They often contain substantial amounts of sweeteners. preservatives. and appealing ingredients such as chocolate. peanuts. and specially-designed flavors (such as flavored potato chips).\\nA snack eaten shortly before going to bed or during the night may be called a \\\"bedtime snack\\\". \\\"late night snack\\\". or \\\"midnight snack\\\".'),(37,4,'marchtabak',1,'piece','https://images.unsplash.com/photo-1616636830943-606a21a78788?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtYXJ0YWJha3xlbnwwfHx8fDE2NTM0NTQwNTY&ixlib=rb-1.2.1&q=80&raw_url=true','Motabbaq (Arabic: \\u0645\\u0637\\u0628\\u0642) is a stuffed pancake or pan-fried bread which is commonly found in the Arabian Peninsula and Southeast Asia. notably in Saudi Arabia. . Yemen. Indonesia. Malaysia. Singapore. Brunei. Thailand and Bangladesh (Mughlai paratha). Depending on the location. the name and ingredients can significantly vary. The name mutabbaq in Arabic means \\\"folded\\\". It is a popular street food in Yemen. Indonesia. Malaysia. and Singapore.Murtabak is often described as spicy folded omelette pancake with bits of vegetables. The most common form of murtabak is made from pan fried crepes usually  stuffed with beaten eggs. chopped leeks. chives. or green onion (scallions) and minced meat.  which is then folded and cut to squares. In Indonesia. the murtabak is one of the most popular street foods and is known as marchtabak.\\nVegetarian murtabaks and other forms of murtabaks with chicken and other stuffings exist and can be found in many Yemeni .Indian Muslim restaurants in Singapore. including the Little India area and Arab Street.In Malaysia. murtabak was originally sold in Indian Muslim restaurants and stalls. and usually includes minced meat (beef or chicken. sometimes goat meat mutton) along with garlic. egg and onion. and is eaten with curry or gravy. sliced cucumber. syrup-pickled onions or tomato sauce. The dish is sold throughout the country. with diverse variations in ingredients and cooking style. and has been adopted by Malay Muslim sellers as well. In Yemen. murtabak also usually includes goat meat or mutton.\\nIn Indonesia. marchtabak is a renowned street food that comes in two types: marchtabak Manis and marchtabak telur. marchtabak Manis or Terang Bulan is originally a thick and sweet pancake that is usually topped with various toppings ranging from chocolate. cheese. peanuts. condensed milk. sesame seed and marchgarine. Today. marchtabak toppings consist of international favours such as Skippy Peanut Butter spread. Ovomaltine. Toblerone. Lotus Biscoff and Durian Spread. marchtabak Manis also recently comes in a thin and crispy variety. known as marchtabak Tipis Kering (Tipker). marchtabak Telur. the savoury type. are crispy pancakes that consist of eggs. chicken or beef meat and scallions.\\n\\n'),(38,4,'Bakso',1,'portion','https://images.unsplash.com/photo-1514570774196-c4a979a4c21d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxiYWtzb3xlbnwwfHx8fDE2NTMzODkzOTM&ixlib=rb-1.2.1&q=80&raw_url=true','Bakso or baso is an Indonesian meatball. or a meat paste made from beef surimi. Its texture is similar to the Chinese beef ball. fish ball. or pork ball. The word bakso may refer to a single meatball or the complete dish of meatball soup. Mie bakso refers to bakso served with yellow noodles and rice vermicelli. while bakso kuah refers to bakso soup served without noodles.\\nBakso can be found all across Indonesia. from street vendors to high-class restaurants. Along with soto. satay. and siomay. bakso is one of the most popular street foods in Indonesia. Today. various types of ready-to-cook bakso are also available as frozen foods sold in supermarchkets in Indonesia.It is usually eaten with noodles.\\n\\n'),(39,4,'Nasi Rames',1,'portion','https://images.unsplash.com/photo-1624957389019-0c814505746d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxuYXNpfGVufDB8fHx8MTY1MzQ1MTU5OQ&ixlib=rb-1.2.1&q=80&raw_url=true','Nasi campur (Indonesian for \'mixed rice\'). also known as nasi rames or \\ua9b1\\ua9bc\\ua992\\u200b\\ua995\\ua9a9\\ua9c0\\ua9a5\\ua9b8\\ua982 (sega campur) [s\\u0259\'g\\u0254 \\u02c8t\\u0283ampur] in Java. refers to an Indonesian dish of a scoop of nasi putih (white rice) accompanied by small portions of a number of other dishes. which includes meats. vegetables. peanuts. eggs. and fried-shrimp krupuk. Depending on origin. a nasi campur vendor might serve several side dishes. including vegetables. fish. and meats. It is a staple meal from Indonesia and popular in Malaysia. Singapore. Brunei. and southern Thailand. and also the Netherlands through its colonial ties with Indonesia. A similar form called chanpur\\u016b exists in Okinawa.\\n\\n'),(40,4,'Sweet Bread',1,'piece','https://images.unsplash.com/photo-1617859047277-9f47d2bd9696?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzd2VldCUyMGJyZWFkfGVufDB8fHx8MTY1MzQ1NDA1Nw&ixlib=rb-1.2.1&q=80&raw_url=true','Sweetbread is a culinary name for the thymus (also called throat. gullet. or neck sweetbread) or pancreas (also called stomach. belly or gut sweetbread). typically from calf (ris de veau) or lamb (ris d\'agneau). The \\\"heart\\\" sweetbreads are more spherical in shape. while the \\\"throat\\\" sweetbreads are more cylindrical in shape. As the thymus is replaced by fibrous tissue in older animals. only pancreatic sweetbreads come from beef and pork. Like other edible non-muscle from animal carcasses. sweetbreads may be categorized as offal. \\\"fancy meat\\\". or \\\"variety meat\\\".:\\u200a4.23\\u200aVarious other glands used as food may also sometimes be called \\\"sweetbreads\\\". including the parotid gland (\\\"cheek\\\" or \\\"ear\\\" sweetbread). the sublingual glands (\\\"tongue\\\" sweetbreads or \\\"throat bread\\\") as well as ovary and testicles.One common preparation of sweetbreads involves soaking in salt water. then poaching in milk. after which the outer membrane is removed. Once dried and chilled. they are often breaded and fried. They are also used for stuffing or in p\\u00e2t\\u00e9s. They are grilled in many Latin American cuisines. such as in the Argentine asado. floured and pan-fried in Greece (sheep\'s thymus is usually used). and served in bread in Turkish cuisine.\\nThe word \\\"sweetbread\\\" is first attested in the 16th century. but the etymology of the name is unclear. \\\"Sweet\\\" is perhaps used since the thymus is sweet and rich-tasting. as opposed to savory-tasting muscle flesh. \\\"Bread\\\" may come from brede. \\\"roasted meat\\\" or from the Old English br\\u01e3d (\\\"flesh\\\" or \\\"meat\\\").'),(41,4,'Wheat Bread',1,'piece','https://images.unsplash.com/photo-1509440159596-0249088772ff?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx3aGVhdCUyMGJyZWFkfGVufDB8fHx8MTY1MzQ1NDA1Nw&ixlib=rb-1.2.1&q=80&raw_url=true','Whole wheat bread or wholemeal bread is a type of bread made using flour that is partly or entirely milled from whole or almost-whole wheat grains. see whole-wheat flour and whole grain. It is one kind of brown bread. Synonyms or near-synonyms for whole-wheat bread outside the United States (e.g.. the UK) are whole grain bread or wholemeal bread. Some regions of the US simply called the bread wheat bread. a comparison to white bread. Some varieties of whole-wheat bread are traditionally coated with whole or cracked grains of wheat. though this is mostly decorative compared to the nutritional value of a good quality loaf itself.'),(42,4,'Satay (food)',1,'portion','https://images.unsplash.com/photo-1603088549155-6ae9395b928f?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzYXRheXxlbnwwfHx8fDE2NTM0NTQwNTc&ixlib=rb-1.2.1&q=80&raw_url=true','Satay ( SAH-tay. in USA also  SA-tay). or sate in Indonesian and Malay spelling. is a Southeast Asian dish of seasoned. skewered and grilled meat. served with a sauce. The earliest preparations of satay is believed to have originated in Javanese cuisine. but has spread to almost anywhere in Indonesia. where it has become a national dish. Indonesian satay is often served with peanut sauce  \\u2013 a sauce made from peanut butter. and is often accompanied with lontong. a type of rice cake. though the diversity of the country has produced a wide variety of satay recipes. It is also popular in many other Southeast Asian countries including Brunei. Malaysia. Philippines. Singapore and Thailand. It also recognized and popular in Surinam and the Netherlands. In Sri Lanka. it has become a staple of the local diet as a result of the influences from the local Malay community.Satay may consist of diced or sliced chicken. goat. mutton. beef. pork. fish. other meats. or tofu; bamboo skewers are often used. while rustic style of preparations employ skewers from the midrib of the coconut palm frond. These are grilled or barbecued over a wood or charcoal fire. then served with various spicy seasonings. Satay can be served in various sauces; however. most often they are served in a combination of soy and peanut sauce. Hence. peanut sauce is often called satay sauce. It is popular as street food. and it can be obtained from a travelling satay vendor. from a street-side tent-restaurant. in an upper-class restaurant. or at traditional celebration feasts.\\nClose analogues are yakitori from Japan. k\\u01ceor\\u00f2u chu\\u00e0n from China. seekh kebab from the Indian Subcontinent. shish kebab from Turkey and the Middle East. shashlik from the Caucasus. and sosatie from South Africa. It is listed at number 14 on World\'s 50 most delicious foods readers\' poll compiled by CNN Go in 2011.\\n\\n'),(43,4,'Soto (food)',1,'portion','https://images.unsplash.com/photo-1572656631137-7935297eff55?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzb3RvfGVufDB8fHx8MTY1MzQ1MTczMg&ixlib=rb-1.2.1&q=80&raw_url=true','Soto (also known as sroto. tauto. saoto. or coto) is a traditional Indonesian soup mainly composed of broth. meat. and vegetables. Many traditional soups are called soto. whereas foreign and Western influenced soups are called sop.\\nSoto is sometimes considered Indonesia\'s national dish. as it is served from Sumatra to Papua. in a wide range of variations. Soto is omnipresent in Indonesia. available in many warungs and open-air eateries on many street corners. to fine dining restaurants and luxurious hotels. Soto. especially soto ayam (chicken soto). is an Indonesian equivalent of chicken soup. Because it is always served warm with a tender texture. it is considered an Indonesian comfort food.Because of the proximity and significant numbers of Indonesian migrants working and settling in neighbouring countries. soto can also be found in Singapore and Malaysia. and has become a part of their cuisine.\\nIntroduced to Suriname by Javanese migrants. it is part of the national cuisine of that country as well. where it is spelled saoto.'),(44,4,'Ice Cream',1,'cup','https://images.unsplash.com/photo-1497034825429-c343d7c6a68f?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxpY2UlMjBjcmVhbXxlbnwwfHx8fDE2NTM0NTQwNTg&ixlib=rb-1.2.1&q=80&raw_url=true','Ice cream is a sweetened frozen food typically eaten as a snack or dessert. It may be made from milk or cream and is flavoured with a sweetener. either sugar or an alternative. and a spice. such as cocoa or vanilla. or with fruit such as strawberries or peaches. It can also be made by whisking a flavored cream base and liquid nitrogen together.  Food coloring is sometimes added. in addition to stabilizers. The mixture is cooled below the freezing point of water and  stirred to incorporate air spaces and to prevent detectable ice crystals from forming. The result is a smooth. semi-solid foam that is solid at very low temperatures (below 2 \\u00b0C or 35 \\u00b0F). It becomes more malleable as its temperature increases.\\nThe meaning of the name \\\"ice cream\\\" varies from one country to another.\\n\\nIce cream and gelato. based on cream and milk.\\nFrozen yogurt. based on yogurt or kefir.\\nFrozen custard. with eggs added to cream and sugar.\\nIce milk.\\nSorbet/slushy. ice pop/popsicle/icicle: Water base. Examples: frozen cola. frozen lemonade. frozen tea.\\nSherbet. like sorbet but with some milk added.In some countries. such as the United States. \\\"ice cream\\\" applies only to a specific variety. and most governments regulate the commercial use of the various terms according to the relative quantities of the main ingredients. notably the amount of cream. Products that do not meet the criteria to be called ice cream are sometimes labelled \\\"frozen dairy dessert\\\" instead. In other countries. such as Italy and Argentina. one word is used for all variants. Analogues made from dairy alternatives. such as goat\'s or sheep\'s milk. or milk substitutes (e.g.. soy. cashew. coconut.  almond milk or tofu). are available for those who are lactose intolerant. allergic to dairy protein. or vegan.\\nIce cream may be served in dishes. for eating with a spoon. or licked from edible wafer cones. Ice cream may be served with other desserts. such as apple pie. or as an ingredient in ice cream floats. sundaes. milkshakes. ice cream cakes and even baked items. such as Baked Alaska.'),(45,5,'Mineral Water',1,'bottle','https://images.unsplash.com/photo-1564919415179-752ca9dadcdf?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtaW5lcmFsJTIwd2F0ZXJ8ZW58MHx8fHwxNjUzMzg5Mzk2&ixlib=rb-1.2.1&q=80&raw_url=true','Mineral water is water from a mineral spring that contains various minerals. such as salts and sulfur compounds. Mineral water may usually be still or sparkling (carbonated/effervescent) according to the presence or absence of added gases.\\nTraditionally. mineral waters were used or consumed at their spring sources. often referred to as \\\"taking the waters\\\" or \\\"taking the cure\\\". at places such as spas. baths. or wells. The term spa was used for a place where the water was consumed and bathed in; bath where the water was used primarchily for bathing. therapeutics. or recreation; and well where the water was to be consumed.\\nToday. it is far more common for mineral water to be bottled at the source for distributed consumption. Travelling to the mineral water site for direct access to the water is now uncommon. and in many cases not possible because of exclusive commercial ownership rights. There are more than 4.000 brands of mineral water commercially available worldwide.In many places the term \\\"mineral water\\\" is colloquially used to mean any bottled carbonated water or soda water. as opposed to tap water.'),(46,5,'Ice (Frozen Water)',1,'portion','https://images.unsplash.com/photo-1516575448682-93a05df8bf59?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxpY2V8ZW58MHx8fHwxNjUzNDU0MDU4&ixlib=rb-1.2.1&q=80&raw_url=true','Ice is water frozen into a solid state. typically forming at or below temperatures of 0 degrees Celsius or 32 degrees Fahrenheit. Depending on the presence of impurities such as particles of soil or bubbles of air. it can appear transparent or a more or less opaque bluish-white color.\\nIn the Solar System. ice is abundant and occurs naturally from as close to the Sun as Mercury to as far away as the Oort cloud objects. Beyond the Solar System. it occurs as interstellar ice. It is abundant on Earth\'s surface \\u2013 particularly in the polar regions and above the snow line \\u2013 and. as a common form of precipitation and deposition. plays a key role in Earth\'s water cycle and climate. It falls as snowflakes and hail or occurs as frost. icicles or ice spikes and aggregates from snow as glaciers and ice sheets.\\nIce exhibits at least eighteen phases (packing geometries). depending on temperature and pressure. When water is cooled rapidly (quenching). up to three types of amorphous ice can form depending on its history of pressure and temperature. When cooled slowly. correlated proton tunneling occurs below \\u2212253.15 \\u00b0C (20 K. \\u2212423.67 \\u00b0F) giving rise to macroscopic quantum phenomena. Virtually all ice on Earth\'s surface and in its atmosphere is of a hexagonal crystalline structure denoted as ice Ih (spoken as \\\"ice one h\\\") with minute traces of cubic ice. denoted as ice Ic and. more recently found. Ice VII inclusions in diamonds. The most common phase transition to ice Ih occurs when liquid water is cooled below 0 \\u00b0C (273.15 K. 32 \\u00b0F) at standard atmospheric pressure. It may also be deposited directly by water vapor. as happens in the formation of frost. The transition from ice to water is melting and from ice directly to water vapor is sublimation.\\nIce is used in a variety of ways. including for cooling. for winter sports. and ice sculpting.'),(47,5,'Juice',1,'portion','https://images.unsplash.com/photo-1600271886742-f049cd451bba?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxqdWljZXxlbnwwfHx8fDE2NTM0NTQwNTg&ixlib=rb-1.2.1&q=80&raw_url=true','Ice is water frozen into a solid state. typically forming at or below temperatures of 0 degrees Celsius or 32 degrees Fahrenheit. Depending on the presence of impurities such as particles of soil or bubbles of air. it can appear transparent or a more or less opaque bluish-white color.\\nIn the Solar System. ice is abundant and occurs naturally from as close to the Sun as Mercury to as far away as the Oort cloud objects. Beyond the Solar System. it occurs as interstellar ice. It is abundant on Earth\'s surface \\u2013 particularly in the polar regions and above the snow line \\u2013 and. as a common form of precipitation and deposition. plays a key role in Earth\'s water cycle and climate. It falls as snowflakes and hail or occurs as frost. icicles or ice spikes and aggregates from snow as glaciers and ice sheets.\\nIce exhibits at least eighteen phases (packing geometries). depending on temperature and pressure. When water is cooled rapidly (quenching). up to three types of amorphous ice can form depending on its history of pressure and temperature. When cooled slowly. correlated proton tunneling occurs below \\u2212253.15 \\u00b0C (20 K. \\u2212423.67 \\u00b0F) giving rise to macroscopic quantum phenomena. Virtually all ice on Earth\'s surface and in its atmosphere is of a hexagonal crystalline structure denoted as ice Ih (spoken as \\\"ice one h\\\") with minute traces of cubic ice. denoted as ice Ic and. more recently found. Ice VII inclusions in diamonds. The most common phase transition to ice Ih occurs when liquid water is cooled below 0 \\u00b0C (273.15 K. 32 \\u00b0F) at standard atmospheric pressure. It may also be deposited directly by water vapor. as happens in the formation of frost. The transition from ice to water is melting and from ice directly to water vapor is sublimation.\\nIce is used in a variety of ways. including for cooling. for winter sports. and ice sculpting.'),(48,5,'Energy Drink',1,'bottle','https://images.unsplash.com/photo-1560689189-65b6ed6228e7?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxlbmVyZ3klMjBkcmlua3xlbnwwfHx8fDE2NTMzODkzOTc&ixlib=rb-1.2.1&q=80&raw_url=true','An energy drink is a type of drink containing stimulant compounds. usually caffeine. which is marchketed as providing mental and physical stimulation (marchketed as \\\"energy\\\". but distinct from food energy). They may or may not be carbonated and may also contain sugar. other sweeteners. herbal extracts. taurine. and amino acids. They are a subset of the larger group of energy products. which includes bars and gels. and distinct from sports drinks. which are advertised to enhance sports performance. There are many brands and varieties in this drink category.\\nCoffee. tea and other naturally caffeinated drinks are usually not considered energy drinks. Other soft drinks such as cola may contain caffeine. but are not considered energy drinks either. Some alcoholic drinks. such as Buckfast Tonic Wine. contain caffeine and other stimulants. According to the Mayo Clinic. it is safe for the typical healthy adult to consume a total of 400 mg of caffeine a day. This has been confirmed by a panel of the European Food Safety Authority (EFSA). which also concludes that a caffeine intake of up to 400 mg per day does not raise safety concerns for adults. According to the ESFA this is equivalent to 4 cups of coffee (90 mg each) or 2 1/2 standard cans (250 ml) of energy drink (160 mg each/80 mg per serving).Energy drinks have the effects of caffeine and sugar. but there is little or no evidence that the wide variety of other ingredients have any effect. Most effects of energy drinks on cognitive performance. such as increased attention and reaction speed. are primarchily due to the presence of caffeine. Other studies ascribe those performance improvements to the effects of the combined ingredients. Advertising for energy drinks usually features increased muscle strength and endurance. but there is no scientific consensus to support these claims. Energy drinks have been associated with many health risks. such as an increased rate of injury when usage is combined with alcohol. and excessive or repeated consumption can lead to cardiac and psychiatric conditions. Populations at risk for complications from energy drink consumption include youth. caffeine-na\\u00efve or caffeine-sensitive. pregnant. competitive athletes and people with underlying cardiovascular disease.'),(49,5,'Soft Drink',1,'bottle','https://images.unsplash.com/photo-1527960471264-932f39eb5846?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzb2Z0JTIwZHJpbmt8ZW58MHx8fHwxNjUzMzg5Mzk4&ixlib=rb-1.2.1&q=80&raw_url=true','A soft drink (see \\u00a7 Terminology for other names) is a drink that usually contains water (often carbonated). a sweetener. and a natural and/or artificial flavoring. The sweetener may be a sugar. high-fructose corn syrup. fruit juice. a sugar substitute (in the case of diet drinks). or some combination of these. Soft drinks may also contain caffeine. colorings. preservatives. and/or other ingredients.\\nSoft drinks are called \\\"soft\\\" in contrast with \\\"hard\\\" alcoholic drinks. Small amounts of alcohol may be present in a soft drink. but the alcohol content must be less than 0.5% of the total volume of the drink in many countries and localities if the drink is to be considered non-alcoholic. Types of soft drinks include lemon-lime drinks. orange soda. cola. grape soda. ginger ale. and root beer.\\nSoft drinks may be served cold. over ice cubes. or at room temperature. They are available in many container formats. including cans. glass bottles. and plastic bottles. Containers come in a variety of sizes. ranging from small bottles to large multi-liter containers. Soft drinks are widely available at fast food restaurants. movie theaters. convenience stores. casual-dining restaurants. dedicated soda stores. vending machines. and bars from soda fountain machines. \\nWithin a decade of the invention of carbonated water by Joseph Priestley in 1767 inventors in Britain and in Europe had used his concept to produce the drink in greater quantities. with one such inventor. J. J. Schweppe. forming Schweppes in 1783 and selling the world\'s first bottled soft drink. Soft drink brands founded in the 19th century include R. White\'s Lemonade in 1845. Dr Pepper in 1885 and Coca-Cola in 1886. Subsequent brands include Pepsi. Irn-Bru. Sprite. Fanta and 7 UP.'),(50,5,'Syrups',1,'bottle','https://images.unsplash.com/photo-1552314971-d2february3513949?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzeXJ1cHxlbnwwfHx8fDE2NTMzODkzOTg&ixlib=rb-1.2.1&q=80&raw_url=true','In cooking. a syrup (less commonly sirup; from Arabic: \\u0634\\u0631\\u0627\\u0628; shar\\u0101b. beverage. wine and Latin: sirupus) is a condiment that is a thick. viscous liquid consisting primarchily of a solution of sugar in water. containing a large amount of dissolved sugars but showing little tendency to deposit crystals. Its consistency is similar to that of molasses. The viscosity arises from the multiple hydrogen bonds between the dissolved sugar. which has many hydroxyl (OH) groups.'),(51,5,'Tea (Pouch)',1,'package','https://images.unsplash.com/photo-1564890369478-c89ca6d9cde9?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx0ZWF8ZW58MHx8fHwxNjUzNDUyNTE2&ixlib=rb-1.2.1&q=80&raw_url=true','A tea bag. or the compound teabag. is a small. porous. sealed bag or packet. typically containing tea leaves or the leaves of other herbs. which is immersed in water to steep and make an infusion. Originally used only for tea (Camellia sinensis). they are now made with other tisanes (\\\"herbal teas\\\") as well.\\nTea bags are commonly made of filter paper or food-grade plastic. or occasionally of silk cotton or silk. The tea bag performs the same function as a tea infuser. Tea bags can be used multiple times until there is no extraction left. Some tea bags have an attached piece of string with a paper label at the top that assists in removing the bag. while also displaying the brand or variety of tea.'),(52,5,'Tea (Beverage)',1,'glass','https://images.unsplash.com/photo-1564890369478-c89ca6d9cde9?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx0ZWF8ZW58MHx8fHwxNjUzNDUyNTE2&ixlib=rb-1.2.1&q=80&raw_url=true','Tea is an aromatic beverage prepared by pouring hot or boiling water over cured or fresh leaves of Camellia sinensis. an evergreen shrub native to China. India and other East Asian countries. Tea is also rarely made from the leaves of Camellia taliensis. After water. it is the most widely consumed drink in the world. There are many different types of tea; some have a cooling. slightly bitter. and astringent flavour. while others have vastly different profiles that include sweet. nutty. floral. or grassy notes. Tea has a stimulating effect in humans primarchily due to its caffeine content.Tea plants are native to East Asia and probably originated in the borderlands of southwestern China and northern Burma. An early credible record of tea drinking dates to the third century AD. in a medical text written by Hua Tuo. It was popularised as a recreational drink during the Chinese Tang dynasty. and tea drinking subsequently spread to other East Asian countries. Portuguese priests and merchants introduced it to Europe during the 16th century. During the 17th century. drinking tea became fashionable among the English. who started to plant tea on a large scale in India.\\nThe term herbal tea refers to drinks not made from Camellia sinensis. They are the infusions of fruit. leaves. or other plant parts. such as steeps of rosehip. chamomile. or rooibos. These may be called tisanes or herbal infusions to prevent confusion with \\\"tea\\\" made from the tea plant.'),(53,6,'Spinachs',1000,'grams','https://images.unsplash.com/photo-1576045057995-568f588f82fb?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzcGluYWNofGVufDB8fHx8MTY1MzM4OTM5OQ&ixlib=rb-1.2.1&q=80&raw_url=true','Spinach (Spinacia oleracea) is a leafy green flowering plant native to central and western Asia. It is of the order Caryophyllales. family Amarchanthaceae. subfamily Chenopodioideae. Its leaves are a common edible vegetable consumed either fresh. or after storage using preservation techniques by canning. freezing. or dehydration. It may be eaten cooked or raw. and the taste differs considerably; the high oxalate content may be reduced by steaming.\\nIt is an annual plant (rarely biennial). growing as tall as 30 cm (1 ft). Spinach may overwinter in temperate regions. The leaves are alternate. simple. ovate to triangular. and very variable in size: 2\\u201330 cm (1\\u201312 in) long and 1\\u201315 cm (0.4\\u20135.9 in) broad. with larger leaves at the base of the plant and small leaves higher on the flowering stem. The flowers are inconspicuous. yellow-green. 3\\u20134 mm (0.1\\u20130.2 in) in diameter. and mature into a small. hard. dry. lumpy fruit cluster 5\\u201310 mm (0.2\\u20130.4 in) across containing several seeds. \\nIn 2018. world production of spinach was 26.3 million tonnes. with China alone accounting for 90% of the total.'),(54,6,'Green Beans',1000,'grams','https://images.unsplash.com/photo-1424593463432-4104fa2c015a?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmVlbiUyMGJlYW58ZW58MHx8fHwxNjUzMzg5NDAw&ixlib=rb-1.2.1&q=80&raw_url=true','Green beans are young. unripe fruits of various cultivars of the common bean (Phaseolus vulgaris). although immature or young pods of the runner bean (Phaseolus coccineus). yardlong bean (Vigna unguiculata subsp. sesquipedalis). and hyacinth bean (Lablab purpureus) are used in a similar way. Green beans are known by many common names. including French beans (or the French: haricot vert). string beans (although most modern varieties are \\\"stringless\\\"). and snap beans or simply snaps. In the Philippines. they are also known as Baguio beans or habichuelas. to distinguish them from yardlong beans.They are distinguished from the many other varieties of beans in that green beans are harvested and consumed with their enclosing pods. before the bean seeds inside have fully matured. An analogous practice is the harvest and consumption of unripened pea pods. as is done with snow peas or sugar snap peas.'),(55,6,'Cassava Leaves',1000,'grams','https://images.unsplash.com/photo-1524546672765-919b3c1d831d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXNzYXZhJTIwbGVhdmV8ZW58MHx8fHwxNjUzMzg5NDAw&ixlib=rb-1.2.1&q=80&raw_url=true','Manihot esculenta. commonly called cassava (). manioc. or yuca (among numerous regional names) is a woody shrub  of the spurge family. Euphorbiaceae. native to South America. Although a perennial plant. cassava is extensively cultivated as an annual crop in tropical and subtropical regions for its edible starchy tuberous root. a major source of carbohydrates. Though it is often called yuca in parts of Spanish America and in the United States. it is not related to yucca. a shrub in the family Asparagaceae. Cassava is predominantly consumed in boiled form. but substantial quantities are used to extract cassava starch. called tapioca. which is used for food. animal feed. and industrial purposes. The Brazilian farinha. and the related garri of West Africa. is an edible coarse flour obtained by grating cassava roots. pressing moisture off the obtained grated pulp. and finally drying it (and roasting both in the case of farinha and garri).\\nCassava is the third-largest source of food carbohydrates in the tropics. after rice and maize. Cassava is a major staple food in the developing world. providing a basic diet for over half a billion people. It is one of the most drought-tolerant crops. capable of growing on marchginal soils. Nigeria is the world\'s largest producer of cassava. while Thailand is the largest exporter of cassava starch.\\nCassava is classified as either sweet or bitter. Like other roots and tubers. both bitter and sweet varieties of cassava contain antinutritional factors and toxins. with the bitter varieties containing much larger amounts. It must be properly prepared before consumption. as improper preparation of cassava can leave enough residual cyanide to cause acute cyanide intoxication. goiters. and even ataxia. partial paralysis. or death. The more toxic varieties of cassava are a fall-back resource (a \\\"food security crop\\\") in times of famine or food insecurity in some places. Farmers often prefer the bitter varieties because they deter pests. animals. and thieves.'),(56,6,'Yardlong Beans',1000,'grams','https://images.unsplash.com/photo-1603046918675-7bee81f7aa0d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmVlbiUyMGJlYW5zfGVufDB8fHx8MTY1MzQ0OTA4Nw&ixlib=rb-1.2.1&q=80&raw_url=true','The asparagus bean (Vigna unguiculata subsp. sesquipedalis) is a legume cultivated for its edible green pods containing immature seeds. like the green bean. It is also known as: yardlong bean. pea bean. long-podded cowpea. Chinese long bean. snake bean. bodi. and bora. Despite the common name of \\\"yardlong\\\". the pods are actually only about half a yard long. so the subspecies name sesquipedalis (one-and-a-half-foot-long; 1.5 feet (0.50 yd)) is a more accurate approximation.\\nA variety of the cowpea. the asparagus bean is grown primarchily for its strikingly long (35 to 75 centimetres (1.15 to 2.46 ft)) immature green pods and has uses very similar to those of the green bean. This plant is in a different genus from the common bean. The many varieties are usually distinguished by the different colors of the mature seeds. It is a vigorous climbing annual vine. The plant is subtropical/tropical and most widely grown in the warmer parts of South Asia. Southeast Asia. and southern China.\\n\\n'),(57,6,'Water Spinach',1000,'grams','https://images.unsplash.com/photo-1648422709905-8c3d148974e1?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx3YXRlciUyMHNwaW5hY2h8ZW58MHx8fHwxNjUzNDUyNTE2&ixlib=rb-1.2.1&q=80&raw_url=true','Ipomoea aquatica. most widely known as kangkong (also spelled kangkung) or water spinach.  is a semi-aquatic. tropical plant grown as a vegetable for its tender shoots. I. aquatica is generally believed to have been first domesticated in Southeast Asia. It is widely cultivated in Southeast Asia. East Asia. and South Asia. It grows abundantly near waterways and requires little to no care.'),(58,6,'Potatos',1000,'grams','https://images.unsplash.com/photo-1518977676601-b53f82aba655?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxwb3RhdG98ZW58MHx8fHwxNjUzMzg5NDAx&ixlib=rb-1.2.1&q=80&raw_url=true','The potato is a starchy tuber of the plant Solanum tuberosum and is a root vegetable native to the Americas. The plant is a perennial in the nightshade family Solanaceae.Wild potato species can be found from the southern United States to southern Chile. The potato was originally believed to have been domesticated by Native Americans independently in multiple locations. but later genetic studies traced a single origin. in the area of present-day southern Peru and extreme northwestern Bolivia. Potatoes were domesticated there approximately 7.000\\u201310.000 years ago. from a species in the Solanum brevicaule complex. In the Andes region of South America. where the species is indigenous. some close relatives of the potato are cultivated.\\nPotatoes were introduced to Europe from the Americas in the second half of the 16th century by the Spanish. Today they are a staple food in many parts of the world and an integral part of much of the world\'s food supply. As of 2014. potatoes were the world\'s fourth-largest food crop after maize (corn). wheat. and rice. Following millennia of selective breeding. there are now over 5.000 different types of potatoes. Over 99% of potatoes presently cultivated worldwide descended from varieties that originated in the lowlands of south-central Chile. The importance of the potato as a food source and culinary ingredient varies by region and is still changing. It remains an essential crop in Europe. especially Northern and Eastern Europe. where per capita production is still the highest in the world. while the most rapid expansion in production over the past few decades has occurred in southern and eastern Asia. with China and India leading the world in overall production as of 2018.\\nLike the tomato. the potato is a nightshade in the genus Solanum. and the vegetative and fruiting parts of the potato contain the toxin solanine which is dangerous for human consumption. Normal potato tubers that have been grown and stored properly produce glycoalkaloids in amounts small enough to be negligible to human health. but. if green sections of the plant (namely sprouts and skins) are exposed to light. the tuber can accumulate a high enough concentration of glycoalkaloids to affect human health.'),(59,6,'Cucumber',1000,'grams','https://images.unsplash.com/photo-1449300079323-02e209d9d3a6?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjdWN1bWJlcnxlbnwwfHx8fDE2NTM0NTI1MTc&ixlib=rb-1.2.1&q=80&raw_url=true','Cucumber (Cucumis sativus) is a widely-cultivated creeping vine plant in the Cucurbitaceae family that bears usually cylindrical fruits. which are used as vegetables. Considered an annual plant. there are three main varieties of cucumber \\u2014 slicing. pickling. and burpless/seedless \\u2014 within which several cultivars have been created. The cucumber originates from South Asia. but now grows on most continents. as many different types of cucumber are traded on the global marchket. In North America. the term wild cucumber refers to plants in the genera Echinocystis and marchah. though the two are not closely related.'),(60,6,'Cabbage',1000,'grams','https://images.unsplash.com/photo-1583116935756-f66cd999cdbe?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx3aGl0ZSUyMGNhYmJhZ2V8ZW58MHx8fHwxNjUzNDQ5Mzkz&ixlib=rb-1.2.1&q=80&raw_url=true','Cabbage. comprising several cultivars of Brassica oleracea. is a leafy green. red (purple). or white (pale green) biennial plant grown as an annual vegetable crop for its dense-leaved heads. It is descended from the wild cabbage (B. oleracea var. oleracea). and belongs to the \\\"cole crops\\\" or brassicas. meaning it is closely related to broccoli and cauliflower (var. botrytis); Brussels sprouts (var. gemmifera); and Savoy cabbage (var. sabauda).\\nA cabbage generally weighs between 500 to 1.000 grams (1 to 2 lb). Smooth-leafed. firm-headed green cabbages are the most common. with smooth-leafed purple cabbages and crinkle-leafed savoy cabbages of both colours being rarer. Under conditions of long sunny days. such as those found at high northern latitudes in summer. cabbages can grow quite large. As of 2012. the heaviest cabbage was 62.71 kilograms (138 lb 4 oz).  Cabbage heads are generally picked during the first year of the plant\'s life cycle. but plants intended for seed are allowed to grow a second year and must be kept separate from other cole crops to prevent cross-pollination. Cabbage is prone to several nutrient deficiencies. as well as to multiple pests. and bacterial and fungal diseases.\\nCabbage was most likely domesticated somewhere in Europe before 1000 BC. although savoys were not developed until the 16th century AD. By the Middle Ages. cabbage had become a prominent part of European cuisine. They can be prepared many different ways for eating; they can be pickled. fermented (for dishes such as sauerkraut). steamed. stewed. roasted. saut\\u00e9ed. braised. or eaten raw. Raw cabbage is a rich source of vitamin K. vitamin C. and dietary fiber. World production of cabbage and other brassicas in 2020 was 71 million tonnes. led by China with 48% of the total.'),(61,6,'Chayotes',1000,'grams','https://images.unsplash.com/photo-1495026206962-e8b160431ffe?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmVlbiUyMHNxdWFzaHxlbnwwfHx8fDE2NTM0NDg1NTI&ixlib=rb-1.2.1&q=80&raw_url=true','Chayote (Sechium edule). also known as mirliton and choko. is an edible plant belonging to the gourd family. Cucurbitaceae. This fruit was first cultivated in the Mesoamericas between southern Mexico and Honduras. with the most genetic diversity available in both Mexico and Guatemala. It is one of several foods introduced to the Old World during the Columbian Exchange. At that time. the plant spread to other parts of the Americas. ultimately causing it to be integrated into the cuisine of many Latin American nations.\\nThe chayote fruit is mostly used cooked. When cooked. chayote is usually handled like summer squash; it is generally lightly cooked to retain the crispy consistency. Raw chayote may be added to salads or salsas. most often marchinated with lemon or lime juice. but is often regarded as especially unpalatable and tough in texture. Whether raw or cooked. chayote is a good source of vitamin C.\\nAlthough most people are familiar only with the fruit as being edible. the root. stem. seeds and leaves are edible as well. The tubers of the plant are eaten like potatoes and other root vegetables. while the shoots and leaves are often consumed in salads and stir fries. especially in Asia.'),(62,6,'Jackfruit (Young)',1000,'grams','https://images.unsplash.com/photo-1596626233681-39f5eb87d501?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxqYWNrZnJ1aXR8ZW58MHx8fHwxNjUzNDUyNTE3&ixlib=rb-1.2.1&q=80&raw_url=true','The jackfruit (Artocarpus heterophyllus). also known as jack tree. is a species of tree in the fig. mulberry. and breadfruit family (Moraceae). Its origin is in the region between the Western Ghats of southern India. all of Bangladesh. Sri Lanka and the rainforests of the Philippines. Indonesia. and Malaysia.The jack tree is well-suited to tropical lowlands. and is widely cultivated throughout tropical regions of the world. It bears the largest fruit of all trees. reaching as much as 55 kg (120 pounds) in weight. 90 cm (35 inches) in length. and 50 cm (20 inches) in diameter. A mature jack tree produces some 200 fruits per year. with older trees bearing up to 500 fruits in a year. The jackfruit is a multiple fruit composed of hundreds to thousands of individual flowers. and the fleshy petals of the unripe fruit are eaten. The ripe fruit is sweet (depending on variety) and is more often used for desserts. Canned green jackfruit has a mild taste and meat-like texture that lends itself to being called a \\\"vegetable meat\\\".Jackfruit is commonly used in South and Southeast Asian cuisines. Both ripe and unripe fruits are consumed. It is available internationally canned or frozen and in chilled meals as are various products derived from the fruit such as noodles and chips.\\nThe Government of Kerala declared jackfruit as official state fruit. [1]'),(63,6,'Mustard Greens',1000,'grams','https://images.unsplash.com/photo-1511993226957-cd166aba52d8?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxncmVlbnMlMjBtdXN0YXJkfGVufDB8fHx8MTY1MzQ1MzAxMQ&ixlib=rb-1.2.1&q=80&raw_url=true','Brassica junecea. commonly brown mustard. Chinese mustard. Indian mustard. leaf mustard. Oriental mustard and vegetable mustard. is a species of mustard plant.'),(64,6,'Bean Sprout',1000,'grams','https://images.unsplash.com/photo-1618158807378-35769f30af82?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxiZWFuJTIwc3Byb3V0fGVufDB8fHx8MTY1MzQ1MjUxOA&ixlib=rb-1.2.1&q=80&raw_url=true','Mung bean sprouts are a culinary vegetable grown by sprouting mung beans. They can be grown by placing and watering the sprouted beans in the shade until the hypocotyls grow long. Mung bean sprouts are extensively cultivated and consumed in East and Southeast Asia and are very easy to grow. requiring minimal care other than a steady supply of water. They are often used in school science projects.'),(65,6,'Eggplant',1000,'grams','https://images.unsplash.com/photo-1615484477201-9f4953340fab?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxlZ2dwbGFudHxlbnwwfHx8fDE2NTM0NTI1MTg&ixlib=rb-1.2.1&q=80&raw_url=true','Eggplant (US. Canada. Australia). aubergine (UK. Ireland) or brinjal (Indian subcontinent. Singapore. Malaysia. South Africa) is a plant species in the nightshade family Solanaceae. Solanum melongena is grown worldwide for its edible fruit.\\nMost commonly purple. the spongy. absorbent fruit is used in several cuisines. Typically used as a vegetable in cooking. it is a berry by botanical definition. As a member of the genus Solanum. it is related to the tomato. chili pepper. and potato. although those are of the New World while the eggplant is of the Old World. Like the tomato. its skin and seeds can be eaten. but. like the potato. it is usually eaten cooked. Eggplant is nutritionally low in macronutrient and micronutrient content. but the capability of the fruit to absorb oils and flavors into its flesh through cooking expands its use in the culinary arts.\\nIt was originally domesticated from the wild nightshade species thorn or bitter apple. S. incanum. probably with two independent domestications: one in South Asia. and one in East Asia. In 2018. China and India combined accounted for 87% of the world production of eggplants.'),(66,6,'Tomatos',1000,'grams','https://images.unsplash.com/photo-1607305387299-a3d9611cd469?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx0b21hdG98ZW58MHx8fHwxNjUzNDUyNTE5&ixlib=rb-1.2.1&q=80&raw_url=true','The tomato is the edible berry of the plant Solanum lycopersicum. commonly known as the tomato plant.  The species originated in western South America and Central America. The Mexican Nahuatl word tomatl gave rise to the Spanish word tomate. from which the English word tomato derived. Its domestication and use as a cultivated food may have originated with the indigenous peoples of Mexico. The Aztecs used tomatoes in their cooking at the time of the Spanish conquest of the Aztec Empire. and after the Spanish encountered the tomato for the first time after their contact with the Aztecs. they brought the plant to Europe. in a widespread transfer of plants known as the Columbian exchange. From there. the tomato was introduced to other parts of the European-colonized world during the 16th century.Tomatoes are a significant source of umami flavor. It is consumed in diverse ways: raw or cooked. and in many dishes. sauces. salads. and drinks. While tomatoes are fruits\\u2014botanically classified as berries\\u2014they are commonly used culinarily as a vegetable ingredient or side dish.Numerous varieties of the tomato plant are widely grown in temperate climates across the world. with greenhouses allowing for the production of tomatoes throughout all seasons of the year. Tomato plants typically grow to 1\\u20133 meters (3\\u201310 ft) in height. They are vines that have a weak stem that sprawls and typically needs support. Indeterminate tomato plants are perennials in their native habitat. but are cultivated as annuals. (Determinate. or bush. plants are annuals that stop growing at a certain height and produce a crop all at once.) The size of the tomato varies according to the cultivar. with a range of 1\\u201310 cm (1\\u20442\\u20134 in) in width.'),(67,6,'Carrots',1000,'grams','https://images.unsplash.com/photo-1598170845058-32b9d6a5da37?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXJyb3R8ZW58MHx8fHwxNjUzNDQ5NzI0&ixlib=rb-1.2.1&q=80&raw_url=true','The carrot (Daucus carota subsp. sativus) is a root vegetable. typically orange in color. though purple. black. red. white. and yellow cultivars exist. all of which are domesticated forms of the wild carrot. Daucus carota. native to Europe and Southwestern Asia. The plant probably originated in Persia and was originally cultivated for its leaves and seeds. The most commonly eaten part of the plant is the tapriloot. although the stems and leaves are also eaten. The domestic carrot has been selectively bred for its enlarged. more palatable. less woody-textured tapriloot.\\nThe carrot is a biennial plant in the umbellifer family. Apiaceae. At first. it grows a rosette of leaves while building up the enlarged tapriloot. Fast-growing cultivars mature within three months (90 days) of sowing the seed. while slower-maturing cultivars need a month longer (120 days). The roots contain high quantities of alpha- and beta-carotene. and are a good source of vitamin A. vitamin K. and vitamin B6.\\nThe United Nations Food and Agriculture Organization (FAO) reports that world production of carrots and turnips (these plants are combined by the FAO) for 2018 was 40 million tonnes. with 45% of the world total grown in China. Carrots are commonly consumed raw or cooked in various cuisines.'),(68,6,'Mung Beans',1000,'grams','https://images.unsplash.com/photo-1594900799266-0e56587ba586?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtdW5nJTIwYmVhbnxlbnwwfHx8fDE2NTM0NTI1MTk&ixlib=rb-1.2.1&q=80&raw_url=true','The mung bean (Vigna radiata). alternatively known as the green gram. maash (Persian: \\u0645\\u0627\\u0634). moong (from Sanskrit: \\u092e\\u0941\\u0926\\u094d\\u0917. romanized: mudga). monggo. or munggo (Philippines). is a plant species in the legume family. The mung bean is mainly cultivated in East. Southeast and South Asia. It is used as an ingredient in both savoury and sweet dishes.'),(69,6,'Peanut',1000,'grams','https://images.unsplash.com/photo-1549978113-29eb25c8177f?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxwZWFudXR8ZW58MHx8fHwxNjUzNDQ5ODk2&ixlib=rb-1.2.1&q=80&raw_url=true','Peanuts is a syndicated daily and Sunday American comic strip written and illustrated by Charles M. Schulz. The strip\'s original run extended from 1950 to 2000. continuing in reruns afterward. Peanuts is among the most popular and influential in the history of comic strips. with 17.897 strips published in all. making it \\\"arguably the longest story ever told by one human being\\\". At the time of Schulz\'s death in 2000. Peanuts ran in over 2.600 newspapers. with a readership of around 355 million in 75 countries. and was translated into 21 languages. It helped to cement the four-panel gag strip as the standard in the United States. and together with its merchandise earned Schulz more than $1 billion.Peanuts focuses entirely on a social circle of young children. where adults exist but are never seen and rarely heard. The main character. Charlie Brown. is meek. nervous. and lacks self-confidence. He is unable to fly a kite. win a baseball game. or kick a football held by his irascible friend Lucy. who always pulls it away at the last instant. Peanuts is one of the literate strips with philosophical. psychological. and sociological overtones that flourished in the 1950s. Peanuts\'s humor is psychologically complex and driven by the characters\' interactions and relationships.\\nPeanuts achieved considerable success with its television specials. several of which. including A Charlie Brown Christmas and It\'s the Great Pumpkin. Charlie Brown. won or were nominated for Emmy Awards. The Peanuts holiday specials remain popular and had been broadcast on network television for over 50 years before moving to the Apple TV+ streaming service in 2020. In addition. the specials occasionally rerun on PBS and PBS Kids since 2020. Peanuts also had successful adaptations in theatre. with the stage musical You\'re a Good Man. Charlie Brown an oft-performed production. In 2013. TV Guide ranked the Peanuts television specials the fourth-greatest TV cartoon of all time. A computer-animated feature film based on the franchise was released in 2015.'),(70,7,'Milkfish',1000,'grams','https://images.unsplash.com/photo-1577105106699-5c230ed0bd70?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtdWxsZXR8ZW58MHx8fHwxNjUzNDUwMDg0&ixlib=rb-1.2.1&q=80&raw_url=true','The milkfish (Chanos chanos) is the sole living species in the family Chanidae. However. there are at least five extinct genera from the Cretaceous.\\nThe repeating scientific name (tautonym) is from Greek khanos (\\u03c7\\u03ac\\u03bd\\u03bf\\u03c2 \\u2018mouth\\u2019).The species has many common names. The Hawaiian name for the fish is awa. and in Tahitian it is ava. It is called bang\\u00fas in the Philippines. where it is popularly known as the national fish. although the National Commission for Culture and the Arts has stated that this is not the case as it has no basis in Philippine law. In the Nauruan language. it is referred to as ibiya. Milkfish is also called bandeng or bolu in Indonesia.Chanos chanos occurs in the Indian Ocean and across the Pacific Ocean. from South Africa to Hawaii and the marchquesas. from California to the Galapagos. north to Japan. south to Australia. Milkfishes commonly live in tropical offshore marchine waters around islands and along continental shelves. at depths of 1 to 30 m. They also frequently enter estuaries and rivers.\\n\\n'),(71,7,'Sea Squid',1000,'grams','https://images.unsplash.com/photo-1530951980629-fbeef86f69a1?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzZWElMjBzcXVpZHxlbnwwfHx8fDE2NTM0NTI1MjA&ixlib=rb-1.2.1&q=80&raw_url=true','Squid are a type of cephalopods in the superorder Decapodiformes with elongated bodies. large eyes. eight arms and two tentacles. Like all other cephalopods. squid have a distinct head. bilateral symmetry. and a mantle. They are mainly soft-bodied. like octopuses. but have a small internal skeleton in the form of a rod-like gladius or pen. made of chitin.\\nSquid diverged from other cephalopods during the Jurassic and occupy a similar role to teleost fish as open water predators of similar size and behaviour. They play an important role in the open water food web. The two long tentacles are used to grab prey and the eight arms to hold and control it. The beak then cuts the food into suitable size chunks for swallowing. Squid are rapid swimmers. moving by jet propulsion. and largely locate their prey by sight. They are among the most intelligent of invertebrates. with groups of Humboldt squid having been observed hunting cooperatively. They are preyed on by sharks. other fish. sea birds. seals and cetaceans. particularly sperm whales.\\nSquid can change colour for camouflage and signalling. Some species are bioluminescent. using their light for counter-illumination camouflage. while many species can eject a cloud of ink to distract predators.\\nSquid are used for human consumption with commercial fisheries in Japan. the Mediterranean. the southwestern Atlantic. the eastern Pacific and elsewhere. They are used in cuisines around the world. often known as \\\"calamarchi\\\". Squid have featured in literature since classical times. especially in tales of giant squid and sea monsters.'),(72,7,'Red Snappers',1000,'grams','https://images.unsplash.com/photo-1615141982883-c7ad0e69fd62?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxyZWQlMjBzbmFwcGVyfGVufDB8fHx8MTY1MzQ1MjUyMA&ixlib=rb-1.2.1&q=80&raw_url=true','The northern red snapper (Lutjanuaryus campechanus) is a species of marchine ray-finned fish. a snapper belonging to the family Lutjanuaryidae. It is native to the western Atlantic Ocean. the Caribbean Sea. and  the Gulf of Mexico. where it inhabits environments associated with reefs.  This species is commercially important and is also sought-after as a game fish.'),(73,7,'Mackerels',1000,'grams','https://images.unsplash.com/photo-1588159482223-dbecdae250a7?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtYWNrZXJlbHxlbnwwfHx8fDE2NTM0NTI1MjA&ixlib=rb-1.2.1&q=80&raw_url=true','Mackerel is a common name applied to a number of different species of pelagic fish. mostly from the family Scombridae. They are found in both temperate and tropical seas. mostly living along the coast or offshore in the oceanic environment.\\nMackerel species typically have vertical stripes on their backs and deeply forked tails. Many are restricted in their distribution ranges and live in separate populations or fish stocks based on geography. Some stocks migrate in large schools along the coast to suitable spawning grounds. where they spawn in fairly shallow waters. After spawning they return the way they came in smaller schools to suitable feeding grounds. often near an area of upwelling. From there they may move offshore into deeper waters and spend the winter in relative inactivity. Other stocks migrate across oceans.\\nSmaller mackerel are forage fish for larger predators. including larger mackerel and Atlantic cod. Flocks of seabirds. whales. dolphins. sharks. and schools of larger fish such as tuna and marchlin follow mackerel schools and attack them in sophisticated and cooperative ways. Mackerel flesh is high in omega-3 oils and is intensively harvested by humans. In 2009. over 5 million tons were landed by commercial fishermen. Sport fishermen value the fighting abilities of the king mackerel.'),(74,7,'Catfishs',1000,'grams','https://images.unsplash.com/photo-1607629265671-111249ba6005?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXRmaXNofGVufDB8fHx8MTY1MzQ1MjUyMQ&ixlib=rb-1.2.1&q=80&raw_url=true','Catfish (or catfishes; order Siluriformes  or Nematognathi) are a diverse group of ray-finned fish. Named for their prominent barbels. which resemble a cat\'s whiskers. catfish range in size and behavior from the three largest species alive. the Mekong giant catfish from Southeast Asia. the wels catfish of Eurasia. and the pira\\u00edba of South America. to detritivores (species that eat dead material on the bottom). and even to a tiny parasitic species commonly called the candiru. Vandellia cirrhosa. Neither the armour-plated types nor the naked types have scales. Despite their name. not all catfish have prominent barbels or \\\"whiskers\\\". Members of the Siluriformes order are defined by features of the skull and swimbladder. Catfish are of considerable commercial importance; many of the larger species are farmed or fished for food. Many of the smaller species. particularly the genus Corydoras. are important in the aquarium hobby.  Many catfish are nocturnal. but others (many Auchenipteridae) are crepuscular or diurnal (most Loricariidae or Callichthyidae. for example).'),(75,7,'Carps',1000,'grams','https://images.unsplash.com/photo-1627241711138-5aca3a7545db?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXJwfGVufDB8fHx8MTY1MzQ1MjUyMQ&ixlib=rb-1.2.1&q=80&raw_url=true','Carp are various species of oily freshwater fish from the family Cyprinidae. a very large group of fish native to Europe and Asia. While carp is consumed in many parts of the world. they are generally considered an invasive species in parts of Africa. Australia and most of the United States.'),(76,7,'Tilapia',1000,'grams','https://images.unsplash.com/photo-1607629194620-a9726803827c?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYXJwJTIwdGlsYXBpYXxlbnwwfHx8fDE2NTM0NTA2OTI&ixlib=rb-1.2.1&q=80&raw_url=true','Tilapia ( tih-LAH-pee-\\u0259) is the common name for nearly a hundred species of cichlid fish from the coelotilapine. coptodonine. heterotilapine. oreochromine. pelmatolapiine. and tilapiine tribes (formerly all were \\\"Tilapiini\\\"). with the economically most important species placed in the Coptodonini and Oreochromini. Tilapia are mainly freshwater fish inhabiting shallow streams. ponds. rivers. and lakes. and less commonly found living in brackish water. Historically. they have been of major importance in artisanal fishing in Africa. and they are of increasing importance in aquaculture and aquaponics. Tilapia can become a problematic invasive species in new warm-water habitats such as Australia. whether deliberately or accidentally introduced. but generally not in temperate climates due to their inability to survive in cold water.\\nTilapia is the fourth-most consumed fish in the United States dating back to 2002. The popularity of tilapia came about due to its low price. easy preparation. and mild taste.'),(77,7,'Tunas',1000,'grams','https://images.unsplash.com/photo-1611518040286-9af8ba97ab46?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHx0dW5hfGVufDB8fHx8MTY1MzQ1MjUyMQ&ixlib=rb-1.2.1&q=80&raw_url=true','A tuna is a saltwater fish that belongs to the tribe Thunnini. a subgrouping of the Scombridae (mackerel) family. The Thunnini comprise 15 species across five genera. the sizes of which vary greatly. ranging from the bullet tuna (max length: 50 cm or 1.6 ft. weight: 1.8 kg or 4 lb) up to the Atlantic bluefin tuna (max length: 4.6 m or 15 ft. weight: 684 kg or 1.508 lb). which averages 2 m (6.6 ft) and is believed to live up to 50 years.\\nTuna. opah and mackerel sharks are the only species of fish that can maintain a body temperature higher than that of the surrounding water. An active and agile predator. the tuna has a sleek. streamlined body. and is among the fastest-swimming pelagic fish \\u2013 the yellowfin tuna. for example. is capable of speeds of up to 75 km/h (47 mph). Greatly inflated speeds can be found in early scientific reports and are still widely reported in the popular literature.Found in warm seas. the tuna is commercially fished extensively as a food fish. and is popular as a bluewater game fish. As a result of overfishing. some tuna species. such as the southern bluefin tuna. are threatened with extinction.'),(78,7,'Shrimps',1000,'grams','https://images.unsplash.com/photo-1628919350249-eb45d8829629?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzaHJpbXB8ZW58MHx8fHwxNjUzNDUyNTIy&ixlib=rb-1.2.1&q=80&raw_url=true','Shrimp are decapod crustaceans with elongated bodies and a primarchily swimming mode of locomotion \\u2013 most commonly Caridea and Dendrobranchiata. More narrow definitions may be restricted to Caridea. to smaller species of either group or to only the marchine species. Under a broader definition. shrimp may be synonymous with prawn. covering stalk-eyed swimming crustaceans with long. narrow muscular tails (abdomens). long whiskers (antennae). and slender legs. Any small crustacean which resembles a shrimp tends to be called one. They swim forward by paddling with swimmerets on the underside of their abdomens. although their escape response is typically repeated flicks with the tail driving them backwards very quickly. Crabs and lobsters have strong walking legs. whereas shrimp have thin. fragile legs which they use primarchily for perching.Shrimp are widespread and abundant. There are thousands of species adapted to a wide range of habitats. They can be found feeding near the seafloor on most coasts and estuaries. as well as in rivers and lakes. To escape predators. some species flip off the seafloor and dive into the sediment. They usually live from one to seven years. Shrimp are often solitary. though they can form large schools during the spawning season.They play important roles in the food chain and are an important food source for larger animals ranging from fish to whales. The muscular tails of many shrimp are edible to humans. and they are widely caught and farmed for human consumption. Commercial shrimp species support an industry worth 50 billion dollars a year. and in 2010 the total commercial production of shrimp was nearly 7 million tonnes. Shrimp farming became more prevalent during the 1980s. particularly in China. and by 2007 the harvest from shrimp farms exceeded the capture of wild shrimp. There are significant issues with excessive bycatch when shrimp are captured in the wild. and with pollution damage done to estuaries when they are used to support shrimp farming. Many shrimp species are small as the term shrimp suggests. about 2 cm (0.79 in) long. but some shrimp exceed 25 cm (9.8 in). Larger shrimp are more likely to be targeted commercially and are often referred to as prawns. particularly in Britain.'),(79,7,'Tin/Canned Fish',1000,'grams','https://images.unsplash.com/photo-1593969430155-d2b315c03c6d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjYW5uZWQlMjBmaXNofGVufDB8fHx8MTY1MzQ1MDgyNA&ixlib=rb-1.2.1&q=80&raw_url=true','Canned or tinned fish are food fish which have been processed. sealed in an airtight container such as a sealed tin can. and subjected to heat. Canning is a method of preserving food. and provides a typical shelf life ranging from one to five years.\\nFish have low acidity. levels at which microbes can flourish. From a public safety point of view. foods with low acidity (pH greater than 4.6) need sterilization at high temperatures (116\\u2013130\\u00b0C). Achieving temperatures above the boiling point requires pressurized cooking.  After sterilization. the containing can prevent microorganisms from entering and proliferating inside. Other than sterilization. no other method is dependable as a preservative. For example. the microorganism Clostridium botulinum (which causes botulism) can only be eliminated at temperatures above the boiling point.\\nPreservation techniques are needed to prevent fish spoilage and lengthen shelf life. They are designed to inhibit the activity of spoilage bacteria and the metabolic changes leading to a loss of fish quality. Spoilage bacteria are the specific bacteria that produce the unpleasant odours and flavours associated with spoiled fish.\\n\\n'),(80,8,'marchgarines',1000,'grams','https://images.unsplash.com/photo-1589985270826-4b7bb135bc9d?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxidXR0ZXJ8ZW58MHx8fHwxNjUzNDUwODkw&ixlib=rb-1.2.1&q=80&raw_url=true','marchgarine (. also UK: . US:  (listen)) is a spread used for flavoring. baking and cooking. It is most often used as a substitute for butter. Although originally made from animal fats. most marchgarine consumed today is made from vegetable oil. The foodstuff was originally named oleomarchgarine from Latin for oleum (olive oil) and Greek marchgarite (pearl indicating luster). The name was later shortened to marchgarine.marchgarine consists of a water-in-fat emulsion. with tiny droplets of water dispersed uniformly throughout a fat phase in a stable solid form. While butter is made from the butterfat of milk. modern marchgarine is made through a more intensive processing of refined vegetable oil and water. In some US jurisdictions. marchgarine must have a minimum fat content of 80 percent (with a maximum of 16% water) to be labeled as such.In the United States. the term \\\"marchgarine\\\" is used to describe \\\"non-dairy spreads\\\" with varying fat contents. and in some places in the United States. it is colloquially referred to as oleo. short for oleomarchgarine. In Britain and Australia. it can be referred to colloquially as marchge.marchgarine can be used as an ingredient in other food products. such as pastries. doughnuts. cakes. and cookies.'),(81,8,'Milk (For Toddler)',1,'pack','https://images.unsplash.com/photo-1550583724-b2692b85b150?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtaWxrfGVufDB8fHx8MTY1MzQ1MjUyMg&ixlib=rb-1.2.1&q=80&raw_url=true','Infant formula. baby formula or just formula (American English) or baby milk. infant milk. false milk. or first milk (British English). is a manufactured food designed and marchketed for feeding to babies and infants under 12 months of age. usually prepared for bottle-feeding or cup-feeding from powder (mixed with water) or liquid (with or without additional water). The U.S. Federal Food. Drug. and Cosmetic Act (FFDCA) defines infant formula as \\\"a food which purports to be or is represented for special dietary use solely as a food for infants by reason of its simulation of human milk or its suitability as a complete or partial substitute for human milk\\\".Manufacturers state that the composition of infant formula is designed to be roughly based on a human mother\'s milk at approximately one to three months postpartum; however. there are significant differences in the nutrient content of these products. The most commonly used infant formulas contain purified cow\'s milk whey and casein as a protein source. a blend of vegetable oils as a fat source. lactose as a carbohydrate source. a vitamin-mineral mix. and other ingredients depending on the manufacturer. In addition. there are infant formulas using soybean as a protein source in place of cow\'s milk (mostly in the United States and Great Britain) and formulas using protein hydrolysed into its component amino acids for infants who are allergic to other proteins. An upswing in breastfeeding in many countries has been accompanied by a deferment in the average age of introduction of baby foods (including cow\'s milk). resulting in both increased breastfeeding and increased use of infant formula between the ages of 3- and 12-months.A 2001 World Health Organization (WHO) report found that infant formula prepared in accordance with applicable Codex Alimentarius standards was a safe complementary food and a suitable breast milk substitute. In 2003. the WHO and UNICEF published their Global Strategy for Infant and Young Child Feeding. which restated that \\\"processed-food products for...young children should. when sold or otherwise distributed. meet applicable standards recommended by the Codex Alimentarius Commission\\\". and also warned that \\\"lack of breastfeeding\\u2014and especially lack of exclusive breastfeeding during the first half-year of life\\u2014are important risk factors for infant and childhood morbidity and mortality\\\".\\nIn particular. the use of infant formula in less economically developed countries is linked to poorer health outcomes because of the prevalence of unsanitary preparation conditions. including lack of clean water and lack of sanitizing equipment. A formula-fed child living in unclean conditions is between 6 and 25 times more likely to die of diarrhea and four times more likely to die of pneumonia than a breastfed child. Rarely. use of powdered infant formula (PIF) has been associated with serious illness. and even death. due to infection with Cronobacter sakazakii and other microorganisms that can be introduced to PIF during its production. Although C. sakazakii can cause illness in all age groups. infants are believed to be at greatest risk of infection. Between 1958 and 2006. there have been several dozen reported cases of E. sakazakii infection worldwide. The WHO believes that such infections are under-reported.'),(82,8,'Milk (For Baby)',1,'pack','https://images.unsplash.com/photo-1550583724-b2692b85b150?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtaWxrfGVufDB8fHx8MTY1MzQ1MjUyMg&ixlib=rb-1.2.1&q=80&raw_url=true','Infant formula. baby formula or just formula (American English) or baby milk. infant milk. false milk. or first milk (British English). is a manufactured food designed and marchketed for feeding to babies and infants under 12 months of age. usually prepared for bottle-feeding or cup-feeding from powder (mixed with water) or liquid (with or without additional water). The U.S. Federal Food. Drug. and Cosmetic Act (FFDCA) defines infant formula as \\\"a food which purports to be or is represented for special dietary use solely as a food for infants by reason of its simulation of human milk or its suitability as a complete or partial substitute for human milk\\\".Manufacturers state that the composition of infant formula is designed to be roughly based on a human mother\'s milk at approximately one to three months postpartum; however. there are significant differences in the nutrient content of these products. The most commonly used infant formulas contain purified cow\'s milk whey and casein as a protein source. a blend of vegetable oils as a fat source. lactose as a carbohydrate source. a vitamin-mineral mix. and other ingredients depending on the manufacturer. In addition. there are infant formulas using soybean as a protein source in place of cow\'s milk (mostly in the United States and Great Britain) and formulas using protein hydrolysed into its component amino acids for infants who are allergic to other proteins. An upswing in breastfeeding in many countries has been accompanied by a deferment in the average age of introduction of baby foods (including cow\'s milk). resulting in both increased breastfeeding and increased use of infant formula between the ages of 3- and 12-months.A 2001 World Health Organization (WHO) report found that infant formula prepared in accordance with applicable Codex Alimentarius standards was a safe complementary food and a suitable breast milk substitute. In 2003. the WHO and UNICEF published their Global Strategy for Infant and Young Child Feeding. which restated that \\\"processed-food products for...young children should. when sold or otherwise distributed. meet applicable standards recommended by the Codex Alimentarius Commission\\\". and also warned that \\\"lack of breastfeeding\\u2014and especially lack of exclusive breastfeeding during the first half-year of life\\u2014are important risk factors for infant and childhood morbidity and mortality\\\".\\nIn particular. the use of infant formula in less economically developed countries is linked to poorer health outcomes because of the prevalence of unsanitary preparation conditions. including lack of clean water and lack of sanitizing equipment. A formula-fed child living in unclean conditions is between 6 and 25 times more likely to die of diarrhea and four times more likely to die of pneumonia than a breastfed child. Rarely. use of powdered infant formula (PIF) has been associated with serious illness. and even death. due to infection with Cronobacter sakazakii and other microorganisms that can be introduced to PIF during its production. Although C. sakazakii can cause illness in all age groups. infants are believed to be at greatest risk of infection. Between 1958 and 2006. there have been several dozen reported cases of E. sakazakii infection worldwide. The WHO believes that such infections are under-reported.'),(83,8,'Milk (For Older)',1,'pack','https://images.unsplash.com/photo-1550583724-b2692b85b150?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxtaWxrfGVufDB8fHx8MTY1MzQ1MjUyMg&ixlib=rb-1.2.1&q=80&raw_url=true','Milk is a nutrient-rich liquid food produced by the mammarchy glands of mammals. It is the primarchy source of nutrition for young mammals (including breastfed human infants) before they are able to digest solid food. Early-lactation milk. which is called colostrum. contains antibodies that strengthen the immune system. and thus reduces the risk of many diseases. Milk contains many other nutrients. including protein and lactose.\\nThe US CDC recommends that children over the age of 12 months should have two servings of dairy milk products a day.As an agricultural product. dairy milk is collected from farm animals. In 2011. dairy farms produced around 730 million tonnes (800 million short tons) of milk from 260 million dairy cows. India is the world\'s largest producer of milk and the leading exporter of skimmed milk powder. but it exports few other milk products. Because there is an ever-increasing demand for dairy products within India. it could eventually become a net importer of dairy products. New Zealand. Germany and the Netherlands are the largest exporters of milk products.More than six billion people worldwide consume milk and milk products. and between 750 and 900 million people live in dairy-farming households.'),(84,8,'Condensed Milk',1,'package','https://images.unsplash.com/photo-1528750997573-59b89d56f4f7?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjb25kZW5zZWQlMjBtaWxrfGVufDB8fHx8MTY1MzQ1MzA5Mg&ixlib=rb-1.2.1&q=80&raw_url=true','Condensed milk is cow\'s milk from which water has been removed (roughly 60% of it). It is most often found with sugar added. in the form of sweetened condensed milk (SCM). to the extent that the terms \\\"condensed milk\\\" and \\\"sweetened condensed milk\\\" are often used interchangeably today. Sweetened condensed milk is a very thick. sweet product. which when canned can last for years without refrigeration if not opened. The product is used in numerous dessert dishes in many countries.A related product is evaporated milk. which has undergone a lengthier preservation process because it is not sweetened. Evaporated milk is known in some countries as unsweetened condensed milk. Both products have a similar amount of water removed.'),(85,8,'Sugar',1000,'grams','https://images.unsplash.com/photo-1559477882-f1a7c5931735?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxzdWdhcnxlbnwwfHx8fDE2NTM0NTI1MjI&ixlib=rb-1.2.1&q=80&raw_url=true','Sugar is the generic name for sweet-tasting. soluble carbohydrates. many of which are used in food. Simple sugars. also called monosaccharides. include glucose. fructose. and galactose. Compound sugars. also called disaccharides or double sugars. are molecules made of two bonded monosaccharides; common examples are sucrose (glucose + fructose). lactose (glucose + galactose). and maltose (two molecules of glucose). White sugar is a refined form of sucrose. In the body. compound sugars are hydrolysed into simple sugars. \\nLonger chains of monosaccharides (>2) are not regarded as sugars. and are called oligosaccharides or polysaccharides. Starch is a glucose polymer found in plants. and is the most abundant source of energy in human food. Some other chemical substances. such as glycerol and sugar alcohols. may have a sweet taste. but are not classified as sugar.\\nSugars are found in the tissues of most plants. Honey and fruit are abundant natural sources of simple sugars. Sucrose is especially concentrated in sugarcane and sugar beet. making them ideal for efficient commercial extraction to make refined sugar. In 2016. the combined world production of those two crops was about two billion tonnes. Maltose may be produced by malting grain. Lactose is the only sugar that cannot be extracted from plants. It can only be found in milk. including human breast milk. and in some dairy products. A cheap source of sugar is corn syrup. industrially produced by converting corn starch into sugars. such as maltose. fructose and glucose.\\n\\nSucrose is used in prepared foods (e.g. cookies and cakes). is sometimes added to commercially available processed food and beverages. and may be used by people as a sweetener for foods (e.g. toast and cereal) and beverages (e.g. coffee and tea). The average person consumes about 24 kilograms (53 pounds) of sugar each year. with North and South Americans consuming up to 50 kg (110 lb) and Africans consuming under 20 kg (44 lb).As sugar consumption grew in the latter part of the 20th century. researchers began to examine whether a diet high in sugar. especially refined sugar. was damaging to human health. Excessive consumption of sugar has been implicated in the onset of obesity. diabetes. cardiovascular disease. and tooth decay. Numerous studies have tried to clarify those implications. but with varying results. mainly because of the difficulty of finding populations for use as controls that consume little or no sugar. In 2015. the World Health Organization recommended that adults and children reduce their intake of free sugars to less than 10%. and encouraged a reduction to below 5%. of their total energy intake.'),(86,8,'Rice (Oryza Sativa)',1000,'grams','https://images.unsplash.com/photo-1516684732162-798a0062be99?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxyaWNlfGVufDB8fHx8MTY1MzQ1MTA4Nw&ixlib=rb-1.2.1&q=80&raw_url=true','Oryza sativa. commonly known as Asian rice. is the plant species most commonly referred to in English as rice. It is the type of farmed rice whose cultivars are most common globally. and was first domesticated in the Yangtze River basin in China 13.500 to 8.200 years ago.Oryza sativa is a grass with a genome consisting of 430Mb across 12 chromosomes. It is renowned for being easy to genetically modify and is a model organism for the botany of cereals.\\n\\n'),(87,8,'Cooking Oils',1,'litre','https://images.unsplash.com/photo-1474979266404-7eaacbcd87c5?crop=entropy&cs=tinysrgb&fm=jpg&ixid=MnwzMzE2MDJ8MHwxfHNlYXJjaHwxfHxjb29raW5nJTIwb2lsfGVufDB8fHx8MTY1MzQ1MzA5Mg&ixlib=rb-1.2.1&q=80&raw_url=true','Cooking oil is plant. animal. or synthetic liquid fat used in frying. baking. and other types of cooking. It is also used in food preparation and flavoring not involving heat. such as salad dressings and bread dips. and may be called edible oil.\\nCooking oil is typically a liquid at room temperature. although some oils that contain saturated fat. such as coconut oil. palm oil and palm kernel oil are solid.There are a wide variety of cooking oils from plant sources such as olive oil. palm oil. soybean oil. canola oil (rapeseed oil). corn oil. peanut oil and other vegetable oils. as well as animal-based oils like butter and lard.\\nOil can be flavored with aromatic foodstuffs such as herbs. chillies or garlic.  Cooking spray is an aerosol of cooking oil.');
